(64784, 'esES', '9.0 Rated PvP Incentive - Shadowlands Season 2 Exclusive Mount', '', '', '', '', '', '', '', '', 39653),
(64651, 'esES', 'Alma de cobra', 'Llévale el alma de cobra a lady Muunn, que está en el Corazón del Bosque.', '<El alma de cobra es codiciosa y protectora. Podrás invocar a voluntad la forma de la cobra>.', '', '', '', '', '', 'Llévale el alma de cobra a lady Muunn, que está en el Corazón del Bosque.', 39653),
(64650, 'esES', 'Alma de hiena', 'Llévale el alma de hiena a lady Muunn, que está en el Corazón del Bosque.', '<El alma de hiena es fogosa y vivaz. Podrás invocar a voluntad la forma de la hiena>.', '', '', '', '', '', 'Llévale el alma de hiena a lady Muunn, que está en el Corazón del Bosque.', 39653),
(64640, 'esES', 'AubriesTestQuestForJeff', '', '', '', '', '', '', '', '', 39653),
(64607, 'esES', 'Tazavesh: Una dura negociación', 'Busca al socio de Au\'manal y ofrécele tu ayuda.', 'Vaya, qué bien te sienta mi obra. ¡Eres la viva imagen de la legitimidad!\n\nY ahora que te he ayudado, te toca corresponder. Busca a mi socio Fe\'tajid en el Embarcadero Dorado y ofrécele tu ayuda.\n\nEspero escuchar pronto las noticias de tu éxito.', '', '', '', '', '', '', 39653),
(64599, 'esES', 'Sagrario de Dominación - Negarse es maldecirse', 'Consigue 4 fragmentos de la filacteria de Kel\'Thuzad en el Sagrario de Dominación en dificultad mítica.', 'Siento la presencia de Kel\'Thuzad en estos pasillos. Tráeme fragmentos de su filacteria para que pueda abrir un nuevo camino hasta sus cámaras.\n\nCon cuatro fragmentos bastará. No nos interesa que vuelva otra vez, ¿verdad?', '', '', '', '', '', '', 39653),
(64598, 'esES', 'Sagrario de Dominación - Negarse es maldecirse', 'Consigue 4 fragmentos de la filacteria de Kel\'Thuzad en el Sagrario de Dominación en dificultad heroica.', 'Siento la presencia de Kel\'Thuzad en estos pasillos. Tráeme fragmentos de su filacteria para que pueda abrir un nuevo camino hasta sus cámaras.\n\nCon cuatro fragmentos bastará. No nos interesa que vuelva otra vez, ¿verdad?', '', '', '', '', '', '', 39653),
(64597, 'esES', 'Sagrario de Dominación - Negarse es maldecirse', 'Consigue 4 fragmentos de la filacteria de Kel\'Thuzad en el Sagrario de Dominación en dificultad normal.', 'Siento la presencia de Kel\'Thuzad en estos pasillos. Tráeme fragmentos de su filacteria para que pueda abrir un nuevo camino hasta sus cámaras.\n\nCon cuatro fragmentos bastará. No nos interesa que vuelva otra vez, ¿verdad?', '', '', '', '', '', '', 39653),
(64571, 'esES', 'Tazavesh: Búsqueda sin destrucción', '', '', '', '', '', '', '', '', 39653),
(64567, 'esES', 'Los eruditos desaparecidos', 'Localiza al erudito Roh-Suir en Korthia.', 'Ah, Caminante de Las Fauces. Tu regreso es una bendición, pues necesitamos tu ayuda.\n\nAlgunos eruditos se han esfumado. Al parecer, la última vez que los vieron estaban estudiando en la gran corte. Tememos que hayan desaparecido o, lo que es peor, que se los hayan llevado quienes intentan alterar nuestro modo de vida.\n\nVen a verme cuando tengas respuestas.\n\nQue el camino te guíe.', '', '', '', '', '', '', 39653),
(64562, 'esES', '¡Sanador!', 'Sana a $1oa aliados de las curias heridos en el Cuórum del Buscador.', '¡Hay muchos heridos en el campo de batalla!\n\nNo todo el mundo conoce el arte de la sanación. Necesitamos más sanadores.\n\nTú, ¡coge mi dispositivo y encárgate de nuestros heridos!', '', '', '', '', '', '', 39653),
(64561, 'esES', 'Los registros de observación', 'Recoge $1oa registros de observación del Nidal Borrascoso y el Estuario del Despertar de Korthia.', 'Saludos, Caminante de Las Fauces. ¿Tienes un momento?\n\nSeguro que sabes que mi cártel ha repartido discretamente una serie de dispositivos de observación por todo Korthia. No obstante, los datos no nos servirán de nada si no los recuperamos. Ahí es donde intervienes tú.\n\nLos registros del Nidal Borrascoso y el Estuario del Despertar ya deben de estar listos. No verás los dispositivos, pero los datos aparecerán como un orbe brillante.\n\n¡No te olvides de mirar bajo tierra!\n\nDevuélvemelos y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(64560, 'esES', 'Recuperación de ánima', 'Recupera $1oa muestras de ánima devorada de los devoradores del Santuario de la Guía.', 'Nuestros objetivos aquí requieren de un suministro constante de tropas, pertrechos y ánima. Esto último es lo más complicado de obtener por razones obvias, pero tengo mis recursos.\n\nCerca de aquí hay una fuente abundante de ánima: los devoradores que asedian el Santuario de la Guía. No es tan fácil como arrebatársela a golpes a un alma, pero es igual de efectivo si eres lo bastante fuerte. ¿Lo eres?', '', '', '', '', '', '', 39653),
(64557, 'esES', 'Hallado en la oscuridad', 'Busca a Ve\'nish en Torghast, Torre de los Condenados.', 'El Cártel Ve tiene fama de merodear por lugares peligrosos en busca de tesoros. Si aún les queda algo de seso, dejarán la adquisición y la venta de mercancías a los Xy. Lástima.\n\nUn miembro de los Ve desapareció en el interior de Torghast con una caja robada llena de objetos poderosos. Creía que le ayudarían a explorar sin correr riesgos. ¡Qué insensatez!', '', '', '', '', '', '', 39653),
(64556, 'esES', 'Necesitan ayuda', 'Completa 3 misiones diarias de Mikanikos, Ta\'nasi y Kael\'thas en Korthia.', 'Los habitantes de Korthia han sufrido mucho. Si no hubiésemos llegado a tiempo, las fuerzas del Carcelero habrían arrasado lo que queda de la Ciudad de los Secretos sin dejar más que destrucción.\n\nDebemos prestar ayuda a los necesitados para continuar nuestra labor.\n\nAcude a la llamada de nuestros aliados, Caminante de Las Fauces. Ocúpate de mirar hasta debajo de las piedras y que no quede ni un aliado del Carcelero con vida.', '', '', '', '', '', '', 39653),
(64555, 'esES', 'Estudiar secretos', 'Habla con los exploradores de las avanzadas en Korthia.', 'Cada curia ha ofrecido expertos en diversas áreas y algunos de ellos han salido a explorar esta tierra desconocida.\n\nDeberían llevar un informe con sus descubrimientos, así que habla con ellos y tráemelos.', '', '', '', '', '', '', 39653),
(64554, 'esES', 'El asalto de los venthyr', 'Completa $1oa misiones en el Bastión de la Perdición y en la Faz del Olvido.', 'Nuestro ataque ha sorprendido a las fuerzas del Carcelero. ¡Invadiremos el Bastión de la Perdición y derrotaremos a sus campeones en el Altar de Dominación!\n\nNecesitamos tu ayuda, Caminante de Las Fauces. ¡Apoya a nuestras fuerzas en el campo de batalla!', '', '', '', '', '', '', 39653),
(64553, 'esES', 'La leyenda de la animapoza', 'Entrega la leyenda de la animapoza a la táctica Sakaa, que está en el Salto del Pecado.', '<Esto parece un conjunto de notas incompleto de una de las investigaciones de los archivistas sobre una fuente de ánima mítica que se halla oculta en Korthia.\n\nLa táctica Sakaa, que está en el Salto del Pecado, podrá ayudarte a organizar un grupo para ir en su busca>.', '', '', '', '', '', 'Entrega la leyenda de la animapoza a la táctica Sakaa, que está en el Salto del Pecado.', 39653),
(64552, 'esES', 'La leyenda de la animapoza', 'Entrega la leyenda de la animapoza a Koros, que está en el Fuerte Elisio.', '<Esto parece un conjunto de notas incompleto de una de las investigaciones de los archivistas sobre una fuente de ánima mítica que se halla oculta en Korthia.\n\nKoros, que está en el Fuerte Elisio, podrá ayudarte a organizar un grupo para ir en su busca>.', '', '', '', '', '', 'Entrega la leyenda de la animapoza a Koros, que está en el Fuerte Elisio.', 39653),
(64551, 'esES', 'La leyenda de la animapoza', 'Entrega la leyenda de la animapoza a Merick Feldscar, que está en el Trono del Prelado.', '<Esto parece un conjunto de notas incompleto de una de las investigaciones de los archivistas sobre una fuente de ánima mítica que se halla oculta en Korthia.\n\nMerick Feldscar, que está en el Trono del Prelado, podrá ayudarte a organizar un grupo para ir en su busca>.', '', '', '', '', '', 'Entrega la leyenda de la animapoza a Merick Feldscar, que está en el Trono del Prelado.', 39653),
(64549, 'esES', 'La leyenda de la animapoza', 'Entrega la leyenda de la animapoza a la vigía Floravíspera, que está el Corazón del Bosque.', '<Esto parece un conjunto de notas incompleto de una de las investigaciones de los archivistas sobre una fuente de ánima mítica que se halla oculta en Korthia.\n\nLa vigía Floravíspera, que está en el Corazón del Bosque, podrá ayudarte a organizar un grupo para ir en su busca>.', '', '', '', '', '', 'Entrega la leyenda de la animapoza a la vigía Floravíspera, que está el Corazón del Bosque.', 39653),
(64541, 'esES', 'El precio de la muerte', '', '', '', '', '', '', '', '', 39653),
(64532, 'esES', 'Las últimas reliquias', 'Examina las reliquias perdidas en el Relicario de Recuerdos y compra el informe de investigación: santuarios antiguos.', 'Te traigo noticias fantásticas, $n. ¡He descubierto las últimas reliquias perdidas! \n\nPuede que te resulte complicado localizarlas, pero he completado la investigación que necesitas para ello.\n\nEcha un vistazo a las últimas reliquias desaparecidas. ¡Estamos muy cerca de tenerlas todas!', '', '', '', '', '', '', 39653),
(64531, 'esES', 'Mor\'geth', '', '', '', '', '', '', '', '', 39653),
(64530, 'esES', 'El cristal de alatumba', 'Entrega el cristal de alatumba a la Pedregosa, que está en el Respiro del Guardián.', '<Este gran fragmento de cristal se ha desprendido del enorme cuerpo del ensamblaje. En su interior crepitan unos destellos de energía.\n\nLa Pedregosa, que está en el Respiro del Guardián, podrá usarlo para potenciar un alatumba para ti>.', '', '', '', '', '', 'Entrega el cristal de alatumba a la Pedregosa, que está en el Respiro del Guardián.', 39653),
(64529, 'esES', 'El núcleo de aquilon intacto', 'Entrega el núcleo de aquilon intacto a Deos, que está en el Respiro del Guardián.', '<El enorme devorador tenía en la mano este núcleo de energía de aquilon cuando murió. No cabe duda de que se lo arrancó a uno de los aquilones destruidos a su alrededor. El núcleo parece casi intacto.\n\nDeos, que está en el Respiro del Guardián, te ayudará a localizar un aquilon que puedas cargar con este núcleo>.', '', '', '', '', '', 'Entrega el núcleo de aquilon intacto a Deos, que está en el Respiro del Guardián.', 39653),
(64528, 'esES', 'La silla de montar de salvajizo', 'Entrega la silla de montar de salvajizo a Reldorn, que está en el Respiro del Guardián.', '<Cuando desmontaste del salvajizo huido, este se sacudió la silla de montar, que cayó a tus pies. Después, se alejó de ti de mala gana cuando las sílfides nocturnas se lo llevaron de regreso al Respiro del Guardián.\n\nReldorn, que está en el Respiro del Guardián, sabrá cómo interpretar este gesto>.', '', '', '', '', '', 'Entrega la silla de montar de salvajizo a Reldorn, que está en el Respiro del Guardián.', 39653),
(64527, 'esES', 'Observación de la persecución', 'Activa el modo guerra y mata a $1oa jugador en el mundo.', 'En nuestras observaciones sobre el conflicto de los tuyos, hemos detectado un alto porcentaje de huida de las presas.\n\nSe trata de una circunstancia que no facilita nuestras investigaciones.\n\nEl Observador ha adquirido una herramienta que creemos que mejorará tu capacidad de forzar un conflicto.\n\nAntes de que te la entreguemos, debes demostrar tu voluntad para participar en tales conflictos con el fin de que podamos garantizar una rentabilidad adecuada para nuestra inversión.', '', '', '', '', '', '', 39653),
(64526, 'esES', 'Fallas misteriosas', 'Examina las reliquias perdidas en el Relicario de Recuerdos y cómprale una llave de falla reparada a Roh-Suir.', 'Muchísimas gracias por tu ayuda, $n. He descubierto más reliquias intactas en el códice.\n\nLa clave para encontrarlas está en las extrañas fallas de Korthia.\n\nPuedo ofrecerte un modo de entrar en estas fallas para que busques más reliquias perdidas.\n\nComo siempre, te he dejado unas muestras del aspecto que tienen. No olvides examinarlas bien antes de partir.', '', '', '', '', '', '', 39653),
(64522, 'esES', 'Los suministros korthianos robados', 'Entrega los suministros korthianos robados a la duquesa Mynx, que está en el Respiro del Guardián.', '<Estos suministros llevan el sello del Avance de la Muerte y los han robado de La Falla sin que nadie se dé cuenta.\n\nLa duquesa Mynx, que está en el Respiro del Guardián, agradecería mucho su devolución >.', '', '', '', '', '', 'Entrega los suministros korthianos robados a la duquesa Mynx, que está en el Respiro del Guardián.', 39653),
(64521, 'esES', 'Los planes de batalla jurainfierno', 'Entrega los planes de batalla jurainfierno a la duquesa Mynx, que está en el Respiro del Guardián.', '<Estos planes de batalla contienen detalles sobre posibles avances hacia Korthia e incluyen informes exhaustivos sobre la capacidad defensiva del Avance de la Muerte en la región.\n\nLa duquesa Mynx, que está en el Respiro del Guardián, puede transmitir rápidamente esta información a quienes la necesiten>.', '', '', '', '', '', 'Entrega los planes de batalla jurainfierno a la duquesa Mynx, que está en el Respiro del Guardián.', 39653),
(64519, 'esES', 'Las cámaras perdidas', 'Examina las reliquias perdidas en el Relicario de Recuerdos.', 'He finalizado la investigación sobre la posible existencia de más reliquias en Korthia. Me parece que siguen en nuestras cámaras de menor tamaño.\n\nCon tu ayuda podré recrear unos dispositivos capaces de reparar las entradas a estas cámaras.\n\nHe colocado unas réplicas de las reliquias desaparecidas. Échales un vistazo para que sepas qué debes buscar.', '', '', '', '', '', '', 39653),
(64513, 'esES', 'La cabeza de Ve\'rayn', 'Entrégale la cabeza de Ve\'rayn a Ve\'nari, que está en el Refugio de Ve\'nari.', '<Ve\'rayn lleva un tiempo persiguiendo a Ve\'nari. Seguro que a Ve\'nari le gustará ver la prueba de que la amenaza ha sido eliminada de forma permanente>.', '', '', '', '', '', 'Entrégale la cabeza de Ve\'rayn a Ve\'nari, que está en el Refugio de Ve\'nari.', 39653),
(64511, 'esES', 'Las reliquias perdidas', 'Examina las reliquias perdidas en el Relicario de Recuerdos.', 'Gracias a ti, he podido recuperar más información sobre las reliquias desaparecidas de la cámara.\n\nHe repasado el códice y me parece que quedan más reliquias en Korthia.\n\nSe guardaron en cofres que, según creo, quedaron repartidos por toda Korthia durante el ataque inicial.\n\nHe consignado las reliquias perdidas aquí. Recuérdalas bien. Debemos recuperarlas.', '', '', '', '', '', '', 39653),
(64509, 'esES', 'Un tocado elegante', '', '', '', '', '', '', '', '', 39653),
(64508, 'esES', '[DNT] Conduit Energy', '', '', '', '', '', '', '', '', 39653),
(64506, 'esES', 'Lo que hay que encontrar', 'Examina qué reliquias faltan en el Relicario de Recuerdos.', 'El códice contiene mucha información. Objetos que se perdieron para siempre y otros que aún existen.\n\nPuede que queden algunas reliquias poderosas y permanezcan ocultas en algún lugar de Korthia. \n\nVe al relicario. Verás algunos de los artefactos que siguen enteros en Korthia.\n\nRecuérdalos bien. Debes encontrarlos y entregármelos.', '', '', '', '', '', '', 39653),
