(64441, 'esES', 'Un cabo suelto', 'Recoge el libro y devuélvelo.', '<Parece que hace poco tiraron un libro de la mesa del campamento venthyr cercano.\n\nA los venthyr les gustaría que se lo devolvieras antes de que los grómits lo usen para hacer sus nidos>.', '', '', '', '', '', '', 39653),
(64438, 'esES', 'Equipo potenciador', 'Habla con el ayudante erudito Kah-Vez para mejorar una pieza de equipo de Korthia.', 'La investigación que has encontrado puede abrirnos muchas posibilidades.\n\nPor ejemplo, podríamos mejorar el equipo que halles en Korthia.\n\nHabla con mi asistente por aquí. Puede usar la información para devolver a este equipo su poder original.', '', '', '', '', '', '', 39653),
(64437, 'esES', 'Informar al Prelado', 'Vuelve con el Prelado, que está en Korthia.', '$n, vuelve a Korthia y dile al Prelado que hemos restaurado el sigilo de la Reina del Invierno.', '', '', '', '', '', '', 39653),
(64432, 'esES', 'De fortaleza a debilidad', 'Potencia el pararrayos y luego mata jurafauces.', '$p, la chatarra que hemos estado recogiendo tiene unas propiedades interesantes. Creo que los jurafauces están imbuyendo su armadura para aumentar su durabilidad.\n\nToma este pararrayos. Primero tendrá que golpearte un rayo. No pongas esa cara, que no te pasará nada. También tienes que subirte a algo de metal jurafauces. Las grandes cadenas incrustadas en Korthia que hay cerca del Nidal Borrascoso servirán.\n\nCuando ya estés... eh... $gcargado:cargada; de energía, enviaré al tauralus Borrhas para que te lleve a la batalla.', '', '', '', '', '', '', 39653),
(64376, 'esES', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64368, 'esES', 'Eficiencia con las reliquias', '', '', '', '', '', '', '', '', 39653),
(64325, 'esES', 'Veterano del Salto del Pecado', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', '¡El Salto del Pecado está ganando influencia gracias a tus triunfos, $n!\n\nTus logros no han pasado desapercibidos, ni siquiera más allá de las fronteras de Revendreth.\n\nLos relatos de tus victorias resuenan en los salones de Oribos. Zo\'sorg, el maestro de conflictos, ha solicitado una reunión contigo en el Enclave.\n\nTiene un gran interés por el arte de la guerra. Te sugiero que no le hagas esperar.', '', '', '', '', '', '', 39653),
(64324, 'esES', 'Veterano de los necroseñores', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', 'El poder de los necroseñores crece gracias a ti, $n.\n\nTus logros no han pasado desapercibidos, ni siquiera más allá de las fronteras de Maldraxxus.\n\nLos relatos de tus victorias resuenan en los salones de Oribos. Zo\'sorg, el maestro de conflictos, ha solicitado una reunión contigo en el Enclave.\n\nTiene un gran interés por el arte de la guerra. Te sugiero que no le hagas esperar.', '', '', '', '', '', '', 39653),
(64323, 'esES', 'Veterano de los kyrianos', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', 'Bastión se está recuperando gracias a ti, $n. El camino está despejado.\n\nTus logros no han pasado desapercibidos, ni siquiera más allá de las fronteras de Bastión.\n\nLos relatos de tus victorias resuenan en los salones de Oribos. Zo\'sorg, el maestro de conflictos, ha solicitado una reunión contigo en el Enclave.\n\nTiene un gran interés por el arte de la guerra. Te sugiero que no le hagas esperar.', '', '', '', '', '', '', 39653),
(64322, 'esES', 'Veterano de las sílfides nocturnas', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', 'Hacía mucho tiempo que Ardenweald no era tan seguro, y es todo gracias a ti.\n\nTus logros no han pasado desapercibidos, ni siquiera más allá de las fronteras de Ardenweald.\n\nLos relatos de tus victorias resuenan en los salones de Oribos. Zo\'sorg, el maestro de conflictos, ha solicitado una reunión contigo en el Enclave.\n\nTiene un gran interés por el arte de la guerra. Te sugiero que no le hagas esperar.', '', '', '', '', '', '', 39653),
(64314, 'esES', 'Curias renovadas', 'Habla con el Prelado y luego reclama los sigilos de cada curia.', 'Queríamos evitar que el Carcelero destruyese la barrera que rodea las Fauces e invadiese el resto de las Tierras Sombrías.\n\nEn lugar de eso, ha expandido Las Fauces para rodear Oribos y hacerse con el sigilo de la Enjuiciadora.\n\nNo comprendo del todo lo que hemos presenciado en lo alto de Torghast, pero seguro que el Prelado sí.\n\nHa llegado la hora de poner en práctica su plan de contingencia. Las curias llegarán pronto con sus sigilos.\n\nInforma al Prelado de que estamos preparados para comenzar.', '', '', '', '', '', '', 39653),
(64306, 'esES', 'Criterios para completar misiones', '', '', '', '', '', '', '', '', 39653),
(64304, 'esES', 'Nuevas oportunidades', 'Mata a $1oa jugadores en Korthia.', '¿Tienes prisa por llegar a alguna parte? Ah, sí. Por casualidad no irás a explorar la nueva y misteriosa masa de tierra de Las Fauces, ¿verdad, Caminante de Las Fauces?\n\nMe pregunto qué secretos guardará.\n\nQuizás podamos hacer algo para ayudarnos mutuamente.\n\nSi te interesa, sigamos hablando. Si no, sigue tu camino. Ya encontraré a alguien que haga el trabajo.', '', '', '', '', '', '', 39653),
(64292, 'esES', 'Maelie la Errante', 'Acepta la responsabilidad de hacerte cargo de Maelie.', '¡Nunca podré agradecerte lo suficiente que hayas encontrado a Maelie! La verdad es que creo que no soy capaz de cuidarla.\n\n¿Te importaría velar por ella? ¡Creo que le caes muy bien!', '', '', '', '', '', '', 39653),
(64290, 'esES', 'Recopilación de investigaciones', 'Habla con el archivista Roh-Suir y entrega las reliquias korthianas para la investigación catalogada.', 'Nos has hecho un gran favor recuperando estos fragmentos. Contribuirán mucho a restaurar nuestros archivos.\n\nUsaré todo lo que has encontrado para reunir más información sobre lo que se perdió en Korthia.\n\nDespués dependerá de ti encontrar más fragmentos y reliquias en Korthia para mejorar los archivos.', '', '', '', '', '', '', 39653),
(64289, 'esES', 'Recoger los pedazos', 'Recupera 50 fragmentos de reliquias de criaturas poco comunes y tesoros por toda Korthia.', 'Muchas cosas se perdieron en Korthia cuando acabó en Las Fauces.\n\nDiversas reliquias de incalculable valor quedaron hechas pedazos. He visto que hay criaturas que llevan los restos de estos objetos. \n\nHay que recuperarlos.\n\nEnfréntate a las fuerzas del Carcelero y busca esos vestigios en las ruinas de Korthia para depositarlos en nuestra antaño gloriosa cámara.', '', '', '', '', '', '', 39653),
(64288, 'esES', 'Baluarte de Ve\'nari', 'Habla con Ve\'nari, que está en el Refugio de Ve\'nari, en Las Fauces.', 'Ven, Caminante de Las Fauces. Reúnete conmigo en mi refugio.\n\nTenemos un último asunto que tratar.\n\nY que no te sigan.', '', '', '', '', '', '', 39653),
(64287, 'esES', 'Baluarte del Códice de los Archivistas', 'Habla con el archivista Roh-Suir, que está en el Relicario de Recuerdos, en Korthia.', 'Te has tomado muchas molestias para recuperar algo que apreciamos muchísimo, Caminante de Las Fauces.\n\nVen a verme mi cámara cuando estés $gpreparado:preparada;. Tengo que discutir un último asunto contigo.', '', '', '', '', '', '', 39653),
(64286, 'esES', 'Baluarte del Avance de la Muerte', 'Habla con la duquesa Mynx, que está en el Respiro del Guardián, en Korthia.', 'Una vez más, has respondido cuando era necesario. Tus esfuerzos no pasan inadvertidos.\n\nVeamos si podemos encontrar una recompensa a la altura de tus logros.', '', '', '', '', '', '', 39653),
(64282, 'esES', 'Llena de sorpresas', 'Localiza el arca de Zovaal.', 'No dejas de sorprenderme, Caminante de Las Fauces. ¡No esperaba en absoluto encontrarte en este sitio!\n\nYa que $gambos:ambas; estamos aquí, creo que deberíamos colaborar.\n\nEl Carcelero tiene un arca en algún lugar de esta falla y está llena de objetos valiosos. ¡Localízala o tráela aquí para que la abramos y compartiremos sus riquezas!', '', '', '', '', '', 'Vuelve con Ve\'nari, con el arca de Zovaal o sin ella.', 39653),
(64274, 'esES', 'Misión de rastreo', '', '', '', '', '', '', '', '', 39653),
(64273, 'esES', 'Contener a los jurainfierno', '', '', '', '', '', '', '', '', 39653),
(64271, 'esES', 'Un camino más civilizado', 'Reúnete con Nadjia cerca del camino que lleva a Korthia.', 'Ah, $p.\n\nTengo un asunto que tratar contigo. Pero aquí no.\n\n<Nadjia mira al resto de habitantes del Respiro del Guardián con suspicacia>.\n\nReúnete conmigo donde acaba el camino de Las Fauces a Korthia y te lo explicaré.', '', '', '', '', '', '', 39653),
(64267, 'esES', 'Los regalos misteriosos de Ve\'nari', 'Habla con Ve\'nari, que está en el Refugio de Ve\'nari, en Las Fauces.', 'Me impresiona tu firme tenacidad para sobrevivir y resultar útil al mismo tiempo, Caminante de Las Fauces. Me recuerdas a mí cuando era más joven e ingenua.\n\nToma esto y prosigue con tu labor... en otro lugar menos llamativo.', '', '', '', '', '', '', 39653),
(64266, 'esES', 'Los suministros del Códice de los Archivistas', 'Habla con el archivista Roh-Suir, que está en el Relicario de Recuerdos, en Korthia.', 'No tengo palabras para expresar la efusión que me invade al ver que tu dedicación ha preservado la historia de Korthia.\n\nPor favor, permíteme compartir mi gratitud.', '', '', '', '', '', '', 39653),
(64255, 'esES', 'Hora de divertirse', '', '', '', '', '', '', '', '', 39653),
(64216, 'esES', 'Conocimiento de la torre', 'Coloca la caja de muchas cosas en Torghast.', 'El poder entretejido en esta caja solo se puede desbloquear alimentándola con orgullo y recuerdos. En su tejido hay encantamientos que, según he visto, se usan en otros reinos para succionar o condicionar almas. Esta... abominación... ha usado estas herramientas de redención y honor para crear una cerradura.\n\nA medida que avances en las plantas de Torghast, tu habilidad, tu velocidad y tu eficacia contribuirán a generar conocimiento de la torre, del que esta caja se alimenta.\n\nAliméntala para recuperar los poderes de su interior.', '', '', '', '', '', 'Coloca la caja de muchas cosas en Torghast.', 39653),
(64214, 'esES', 'Un símbolo de esperanza', 'Ayuda a examinar la brújula de Anduin.', 'Anduin dejó caer algo antes de seguir al Carcelero a través del portal.\n\nNo tengo claro qué era, pero Jaina lo recogió. ¡Puede que sea una señal de que sigue resistiéndose al Carcelero!\n\nDebemos averiguar qué es y por qué nos lo ha dejado el joven rey.', '', '', '', '', '', '', 39653),
(64213, 'esES', 'Un símbolo de esperanza', 'Ayuda a Jaina a examinar la brújula de Anduin.', 'Anduin dejó caer algo antes de seguir al Carcelero a través del portal.\n\nNo creo que ese gesto entrase en los planes del Carcelero. ¡Debe ser una señal de que Anduin aún tiene el control de su alma!\n\n<Jaina abre la mano y te muestra una brújula dorada>.\n\nEs un objeto personal de Anduin. Noto su presencia en él.\n\nDebemos averiguar por qué nos la dejó.', '', '', '', '', '', '', 39653),
(64212, 'esES', 'Un portal en la oscuridad', 'Habla con Thrall y presencia el desenlace de la batalla en Torghast.', 'Me temo que han frenado nuestros intentos de detener a Zovaal, mortal.\n\nSe ha abierto un portal a un reino prohibido... y el Desterrado se ha apoderado de un poder que se le arrebató hace mucho tiempo.\n\nPercibo que tus aliados han regresado del Sagrario de Dominación. Debo averiguar todos los detalles de lo ocurrido.', '', '', '', '', '', '', 39653),
(64211, 'esES', 'Un portal en la oscuridad', 'Habla con Jaina y presencia el desenlace de la batalla en Torghast.', 'Me temo que han frenado nuestros intentos de detener a Zovaal, mortal.\n\nSe ha abierto un portal a un reino prohibido... y el Desterrado se ha apoderado de un poder que se le arrebató hace mucho tiempo.\n\nPercibo que tus aliados han regresado del Sagrario de Dominación. Debo averiguar todos los detalles de lo ocurrido.', '', '', '', '', '', '', 39653),
(64210, 'esES', 'La caja de muchas cosas', 'Llévale la caja de muchas cosas al Grabador de Runas.', 'Ah, Caminante de Las Fauces, por supuesto. No tardaré en desaparecer. Este lugar me reclamará para siempre, pero tú seguirás recorriendo sus salones, ¡$gajeno:ajena; a él!\n\nMi mayor aspiración era prevalecer con la ayuda de esta caja. Por desgracia, sobrestimé mis propias capacidades.\n\nConfío en no hacer lo mismo con las tuyas. Llévate la caja. Demuestra que eres $gdigno:digna; de ella.', '', '', '', '', '', '', 39653),
(64202, 'esES', 'Te echo una mano', 'Acepta la ayuda de Nilganihmaht.', 'Tu poder, Caminante de Las Fauces..., rivaliza incluso con el mío antes de que Zovaal desmembrara mi cuerpo.\n\nEsto constituye solo una pequeña parte de mi ser completo, pero es más que suficiente...\n\nDeja que te ayude en tu lucha contra Zovaal. Así cumpliré mi venganza.', '', '', '', '', '', '', 39653),
(64194, 'esES', 'Prototipo de guerra', 'Usa el prototipo Atleos en el Nidal Borrascoso para derrotar a Kraxis.', 'Como forjador supremo, siempre estoy trabajando para mejorar algo.\n\nPero los centuriones más grandes son demasiado grandes para traerlos a Korthia. Lo debo corregir. Aquí tienes a Atleos, un prototipo de coloso de campo. ¡La vanguardia de los kyrianos!\n\nTodavía hay que probarlo. Y mucho. Tiene que ser perfecto para luchar contra un oponente poderoso.\n\n¡Llévate a Atleos y derrota a una gran bestia de Las Fauces! ¡Pulsa todos los botones!', '', '', '', '', '', '', 39653),
(64191, 'esES', 'El equipo de Lassik', '', '', '', '', '', '', '', '', 39653),
(64190, 'esES', 'La bandeja de Manosfirmes', '', '', '', '', '', '', '', '', 39653),
(64189, 'esES', 'El apoyo de Kinessa', '', '', '', '', '', '', '', '', 39653),
(64188, 'esES', 'Suministros de Ryuja', '', '', '', '', '', '', '', '', 39653),
(64187, 'esES', 'La búsqueda de Kiaranyka', '', '', '', '', '', '', '', '', 39653),
(64186, 'esES', 'Núcleo de energía desaparecido de ELGU - 007', '', '', '', '', '', '', '', '', 39653),
(64185, 'esES', '¿Ayudar a Ella?', '', '', '', '', '', '', '', '', 39653),
(64184, 'esES', 'Un amigo desaparecido', '', '', '', '', '', '', '', '', 39653),
(64175, 'esES', 'Campeón: Lassik Doblaespinazos', '', '', '', '', '', '', '', '', 39653),
(64174, 'esES', 'Campeón: Manosfirmes', '', '', '', '', '', '', '', '', 39653),
(64173, 'esES', 'Campeona: Kinessa la Permeable', '', '', '', '', '', '', '', '', 39653),
(64172, 'esES', 'Campeona: Ryuja Puñodescarga', '', '', '', '', '', '', '', '', 39653),
(64171, 'esES', 'Campeona: Kiaranyka', '', '', '', '', '', '', '', '', 39653),
(64170, 'esES', 'Campeona: ELGU - 007', '', '', '', '', '', '', '', '', 39653),
(64169, 'esES', 'Campeona: Ella', '', '', '', '', '', '', '', '', 39653),
(64168, 'esES', 'Campeón: Espora de Marasmius', '', '', '', '', '', '', '', '', 39653),
(64166, 'esES', 'Memoria de acceso aleatorio', 'Consigue recuerdos korthianos con las alas efímeras.', 'Cuando el Carcelero se hizo con Korthia y la trajo a Las Fauces, destruyó muchas cosas. No solo montañas y edificios, sino también gente.\n\nEsas personas tenían vidas, esperanzas, recuerdos...\n\nQuiero pensar que no todo se ha perdido y que podemos salvar algo de lo que aún siga aquí.\n\nToma, te entrego parte de mi poder. Ve a ver si puedes reunir esos recuerdos. Tráemelos y yo los guardaré a buen recaudo.\n\nNadie debería caer en el olvido.', '', '', '', '', '', '', 39653),
(64138, 'esES', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64131, 'esES', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64129, 'esES', 'La carga de la Cacería Salvaje', 'Monta en Aldermeigh y mata jurafauces en Korthia.', 'Desde que me uní a la Cacería Salvaje he aprendido muchas cosas sobre cómo luchar y defender los reinos.\n\nAdmito que sigo aprendiendo, pero me alegro mucho de aprender contigo y con mi amigo, el venado rúnico Aldermeigh.\n\nLo estamos entrenando para que cargue en batalla con la valentía de un vorkai, pero necesita práctica. ¿Puedes llevarlo a dar una vuelta y acabar con todos los jurafauces que encuentres?', '', '', '', '', '', '', 39653),
(64106, 'esES', 'Un esfuerzo conjunto', 'Ayuda a las curias a atacar a las fuerzas del Carcelero en Las Fauces.', 'Te has procurado unos aliados poderosos tanto en tu curia como en el resto de las Tierras Sombrías. Este vínculo es la razón de que hayan decidido sumarse a tu causa.\n\nEstán listos para luchar a nuestro lado en el ataque a Las Fauces.\n\nCada curia atacará al Carcelero desde una zona diferente. Ayúdalos a peinar esta tierra traicionera en busca de servidores de Zovaal para que podamos poner fin a su creciente influencia.', '', '', '', '', '', '', 39653),
(64103, 'esES', 'Los viejos trucos funcionan mejor', 'Mata a Moros, Oizys y Apate, comandantes de los jurafauces.', '$p. Aquí estamos otra vez, luchando codo con codo para proteger las Tierras Sombrías.\n\nEstamos librando una guerra perdida, pero aún podemos cambiar las tornas. Necesito que localices a unos comandantes concretos de las tropas de los jurafauces. En todo ejército hay comandantes buenos y malos. Si eliminamos a los buenos, solo los malos avanzarán, lo que debilitará su ejército.\n\nNuestros ojos nos han facilitado sus nombres. Ahora solo tienes que matarlos.', '', '', '', '', '', '', 39653),
(64101, 'esES', 'Los procedimientos apropiados', 'Consigue $1oa receptáculos de ánima perdidos.', 'He venido a observar las acciones de los habitantes de Revendreth. Sin embargo, me han llegado noticias preocupantes.\n\n$p, los auxiliares me cuentan que han almacenado ánima en unos botes y que nuestra propia gente los está saqueando. Así no se hacen las cosas.\n\n¿Puedo encargarte que recuperes el ánima para que la devolvamos adonde debe estar?', '', '', '', '', '', '', 39653),
(64092, 'esES', 'En busca de Huln', 'Ponte un disfraz y busca a Huln Monte Alto en la Fortaleza de la Dominancia mientras evitas a los guardias.', 'Huln anda por aquí cerca, pero la Pedregosa no deja entrar a nadie en su territorio debido a los recientes, eh... problemas con los Señores del Terror. Los guardias han cerrado los accesos y están echando a cualquiera que no parezca de aquí.\n\nPor suerte para Huln, ¡a Caragarrote y a mí se nos ha ocurrido un plan infalible!\n\nSolo tenemos que hacernos pasar por alguien de aquí, preguntar y encontrar a Huln. ¡Chupao!', '', '', '', '', '', '', 39653),
(64091, 'esES', 'Mal\'Genio', 'Consigue los sigilos de vinculación.', '<El Señor del Terror te clava la mirada. Es evidente quiere hablar. Miras a tus compañeros. Bayalunar te alienta a que avances con una sonrisa maliciosa. Te acercas todo cuanto te atreves>.\n\nLibérame de esta prisión, mortal, y tendrás mi favor. Estoy en contacto con poderes superiores a los de estos insignificantes títeres y sus amos. No saben nada de las auténticas fuerzas que actúan aquí.\n\nSolo necesito los sigilos de vinculación que me retienen. Del resto... puedo ocuparme yo.\n\nLibérame y te otorgaré un poder inconmensurable.', '', '', '', '', '', '', 39653),
(64090, 'esES', 'El gran aprieto', 'Dirígete al lugar donde Caragarrote cree que se llevaron a Huln y mézclate con el gentío.', 'Así que nuestro amigo azul desaparecido se ha metido en un buen aprieto. Suerte que soy más listo que el hambre.\n\nEntramos tan panchos como si trabajáramos allí, buscamos a tu alce sin hacer contacto visual con los colmillos y salimos pitando. ¿Me sigues?', '', '', '', '', '', '', 39653),
(64086, 'esES', 'Táctico de los kyrianos', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', 'Mira a tu alrededor, $n. El Fuerte Elisio se alza como testimonio del progreso que hemos logrado gracias a ti.\n\nZo\'sorg ha vuelto a solicitar tu presencia en Oribos. Ve de inmediato.\n\nNo podemos desaprovechar el favor del Cártel Zo. La confianza de un clan de especuladores no se obtiene con facilidad.\n\nQuizás quieran ofrecerte más recompensas.', '', '', '', '', '', '', 39653),
(64085, 'esES', 'Táctico de las sílfides nocturnas', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', 'Tu valentía ha permitido crecer una vez más a Ardenweald. Y también ha llamado de nuevo la atención de los Especuladores.\n\nZo\'sorg ha vuelto a solicitar tu presencia en Oribos. Ve de inmediato.\n\nNo podemos desaprovechar el favor del Cártel Zo. La confianza de un clan de especuladores no se obtiene con facilidad.\n\nQuizás quieran ofrecerte más recompensas.', '', '', '', '', '', '', 39653),
(64084, 'esES', 'Táctico de los necroseñores', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', 'Has traído gran honor a los necroseñores. Y este honor sigue llamando la atención de otros.\n\nZo\'sorg ha vuelto a solicitar tu presencia en Oribos. Ve de inmediato.\n\nNo podemos desaprovechar el favor del Cártel Zo. La confianza de un clan de especuladores no se obtiene con facilidad.\n\nQuizás quieran ofrecerte más recompensas.', '', '', '', '', '', '', 39653),
(64083, 'esES', 'Táctico del Salto del Pecado', 'Reúnete con Zo\'sorg en el Enclave, en Oribos.', '¡El Salto del Pecado está ganándose más respeto del que Denathrius podría haber imaginado! Y es todo gracias a tus esfuerzos, $n.\n\nZo\'sorg ha vuelto a solicitar tu presencia en Oribos. Ve de inmediato.\n\nNo podemos desaprovechar el favor del Cártel Zo. La confianza de un clan de especuladores no se obtiene con facilidad.\n\nQuizás quieran ofrecerte más recompensas.', '', '', '', '', '', '', 39653),
(64080, 'esES', 'Pie a tierra', 'Usa la jabalina de Korayn para alancear a $1oa presagistas jurafauces.', 'Puedo oír cómo baten las alas los jurafauces mientras surcan los cielos, provocándonos.\n\nPero pájaro en mano... es más fácil de aplastar.\n\nToma mi lanza y prueba tu puntería. Derriba unos cuantos y acaba con ellos.\n\nAsegúrate de usar la lanza. No des vueltas entre ellos para que te persigan por tierra. Ese no es el objetivo.\n\nQuiero ver cómo los haces caer.', '', '', '', '', '', '', 39653),
(64070, 'esES', 'Chatarra de guerra', 'Consigue $1oa piezas de chatarra de los jurafauces.', 'Nuestro ejército siempre necesita más armas, armaduras y tropas. Siempre.\n\nEstamos recibiendo refuerzos, pero no puedo armar como es debido a todo el mundo a este ritmo. Sobre todo sin una forja en condiciones ni ayudantes.\n\nTendremos que apañarnos con lo que tengamos. Necesito que me traigas toda la chatarra de los jurafauces que puedas encontrar. Ya se me ocurrirá algo para convertirla en armas útiles.', '', '', '', '', '', '', 39653),
(64065, 'esES', 'Componentes locales', 'Consigue $1oa garfas de pellejosquirla, $2oa patas de grómit y $3oa espinas de alafilada.', 'Korthia es un lugar extraño. Aquí la fauna es diferente, seguramente debido a años de exposición a la cámara y su contenido.\n\n¿Estás $gpreparado:preparada; para realizar unos experimentos? Primero habrá que hacer acopio de componentes.\n\nCerca del Cuórum del Buscador encontrarás pellejosquirlas, grómits y alafiladas. ¡Ten cuidado con las espinas!', '', '', '', '', '', '', 39653),
(64043, 'esES', '¡Sanador!', 'Sana a $1oa aliados de las curias heridos en el Cuórum del Buscador.', '¡Hay muchos heridos en el campo de batalla!\n\nNo todo el mundo conoce el arte de la sanación. Necesitamos más sanadores.\n\nTú, ¡coge mi dispositivo y encárgate de nuestros heridos!', '', '', '', '', '', '', 39653),
(64042, 'esES', 'Rituales nocturnos', 'Ayuda con los preparativos y con el ritual.', 'A Tyrande se le acaba el tiempo, así que debemos actuar con premura.\n\n<Ysera frunce el ceño, preocupada>.\n\nAlbergábamos la esperanza de reunir más Guerreras Nocturnas, pero tendremos que continuar con las que tenemos y esperar que sean suficientes.\n\n<Ysera sacude cabeza, pero ahora parece más decidida>.\n\nAntes de comenzar, debemos concluir los preparativos para el ritual. Reúne los objetos que faltan y tráelos a la arboleda; te esperamos allí.', '', '', '', '', '', '', 39653),
(64018, 'esES', 'El peso de la piedra', 'Ayuda a la Legión Pétrea a entregar suministros y ánima.', 'La campaña continúa, $p. Ha llegado la Legión Pétrea para cambiar las tornas de la batalla.\n\nEn primer lugar, debemos entregar suministros a nuestros aliados. Debido a la irregularidad del terreno en Korthia, somos los únicos capaces de mantener bien pertrechadas a las tropas.\n\nEn segundo lugar, debemos encargarnos de los jurafauces y los devoradores. Mi estrategia es muy sencilla: vamos a lanzar ánima sobre los jurafauces. Eso atraerá a los devoradores, que se lanzarán al ataque. Y, entonces, o acaban con los jurafauces o los jurafauces los eliminan. En cualquier caso, ganamos nosotros.', '', '', '', '', '', '', 39653),
(64016, 'esES', 'Un moco de a-postín', 'Ayuda Flemín a probar su capacidad de crecimiento con los pellejosquirlas del Mirador del Magullador.', '¡Aprendiz! Te estaba buscando.\n\nKevin ha sido tan buen ayudante en nuestros experimentos que quiero entrenar a mis otros mocos para que colaboren también.\n\nMe gustaría saber si Flemín puede consumir material orgánico y aumentar de tamaño.', '', '', '', '', '', '', 39653),
(64014, 'esES', 'El cuerno de Las Fauces', 'Pide ayuda a Ve\'nari para vincular el Ilskacuerno a Las Fauces.', 'Nos queda una tarea pendiente antes de que comience la gloriosa batalla. El cuerno debe anclarse a Las Fauces para que su voz pueda perforar la barrera que rodea ese reino infecto.\n\nEl problema es que no sé cómo hacerlo. Encuentra a alguien que comprenda los misterios de ese lugar y seguro que podrá ayudarte.\n\nDanica y sus hermanas estarán atentas a la llamada de Ilskacuerno y responderán cuando las necesites, $n.', '', '', '', '', '', '', 39653),
(64012, 'esES', 'Suministros del Avance de la Muerte', 'Habla con la duquesa Mynx, que está en el Respiro del Guardián, en Korthia.', 'Tu trabajo a la hora de impedir el avance del Carcelero no ha pasado inadvertido. Si buscas poder para proseguir con tu empeño, creo que puedo serte de ayuda.', '', '', '', '', '', '', 39653),
(64007, 'esES', 'El asalto de las curias', 'Reúne a las tropas de las curias para entrar en Las Fauces.', 'Gracias a tus esfuerzos y a los del resto de héroes de Azeroth, las curias se han fortalecido. Pero ya no podemos esperar a que el Carcelero actúe.\n\nEl camino a Las Fauces está despejado. Nuestras fuerzas, preparadas.\n\nLas curias esperan tu señal, $n.', '', '', '', '', '', 'Habla con Bolvar Fordragón, que está en Korthia.', 39653),
(63994, 'esES', '¿Quién camina en Las Fauces?', 'Participa en la prueba para Caminantes de Las Fauces de Tal-Galan.', 'Las profecías de Korthia vaticinaron la llegada de un ser que camina por Las Fauces y que nos salvará del desastre. \n\nTal vez sea hoy el día. O tal vez no. Debo poner a prueba tu ánima para determinar si eres quien dices ser.\n\nSi es verdad, tengo el solemne deber de potenciar tu ánima antes de hacer nada más.', '', '', '', '', '', '', 39653),
(63990, 'esES', 'La hoja en la noche', 'Busca pistas en el Sepulcro del Saber.', 'Aunque mi cacería ha sido ardua, tengo dos pistas prometedoras sobre otras Guerreras Nocturnas. La primera está aquí, en Maldraxxus.\n\nEsta torre alberga registros de quienes han llegado a Maldraxxus y hay alguien a quien llaman \"la hoja en la noche\". Creo que es nuestra siguiente Guerrera Nocturna.\n\nMe he topado con muchas trampas en mi camino hasta aquí. Sin duda, encontraremos más dentro de la torre. Alguien intenta detenernos.\n\nNo permitiremos que lo haga.', '', '', '', '', '', '', 39653),
(63989, 'esES', 'Un moco de a-postín', 'Ayuda a Apestín a probar su capacidad infecciosa en el Mirador del Magullador.', '¡Aprendiz! Te estaba buscando.\n\nKevin ha sido tan buen ayudante en nuestros experimentos que quiero entrenar a mis otros mocos para que colaboren también.\n\n¿Puedes llevarte a Apestín para probar su capacidad de infectar formas de vida orgánicas?', '', '', '', '', '', '', 39653),
(63987, 'esES', 'El paquete perdido de Ve\'lor', '', '', '', '', '', '', '', '', 39653),
(63986, 'esES', 'Tazavesh: En busca del artefacto perdido', 'Entra en Tazavesh y derrota a So\'leah.', 'Creo que tendrás que demostrar tu fuerza de nuevo, $gamigo mío:amiga mía;. La seguridad de Tazavesh no nos dejará entrar por las buenas.\n\nNo obstante, debemos detener a So\'leah y, si eso requiere algo de... persuasión física, qué remedio. \n\nTráete algunos amigos. Tengo la corazonada de que la seguridad de aquí se guarda algún as en la manga.', '', '', '', '', '', '', 39653),
(63985, 'esES', 'El Mercado Velado', 'Monta en la barcaza a Tazavesh.', 'A ver si lo adivino... ¿Te envía Ta\'oku? \n\n<Ta\'meri observa la moneda que le entregas>.\n\nConque quieres viajar a Tazavesh. No solemos ofrecer ese servicio a los forasteros. No obstante, dado que has pagado la cuota, será un placer ayudarte.\n\nSube a bordo y no te olvides de mantener todas las extremidades en el interior del transporte en todo momento. Las corrientes de la Zona Intermedia pueden ser muy traicioneras.', '', '', '', '', '', '', 39653),
(63984, 'esES', 'Monedas para el barquero', 'Habla con Ta\'meri, que está en Oribos.', 'Has cumplido tu parte del trato, Caminante de Las Fauces. Ahora me toca a mí.\n\nMi cártel controla un transbordador que opera entre Oribos y Tazavesh. Se dedica al transporte de mercancías, pero siempre hay... excepciones.\n\nDale esta moneda a Ta\'meri y te llevará al mercado.\n\nLo que pase después depende de ti.\n\n<Ta\'oku se inclina y emite un sonido muy parecido a una risilla>.', '', '', '', '', '', 'Habla con Ta\'meri, que está en Oribos.', 39653),
(63983, 'esES', 'Ariete destructor', 'Recupera el prototipo de aquilon.', 'Ta\'nla ha pedido algo muy... concreto... para un cliente suyo.\n\nLos kyrianos han estado trabajando en un nuevo tipo de centurión al que llaman aquilon. He enviado varios especialistas comerciales a hacerse con el prototipo en cuestión, pero no han regresado.\n\nY, obviamente, hasta que no tenga el objeto, no puedo enviárselo a Ta\'nla. Podríamos ayudarnos mutuamente.\n\nSi localizas el aquilon y me lo traes, te ayudaré a llegar a Tazavesh.', '', '', '', '', '', '', 39653),
(63982, 'esES', 'Estación inalcanzable', 'Usa el portal del Mercado Nocturno y habla con Ta\'oku.', 'Aunque conozco la ubicación del Mercado Velado, me temo que poco puedo hacer en cuanto al transporte hacia allí.\n\nPuedo enviarte con alguien que puede ayudarnos a ambos a cambio de que hagas algo por mí. Hay un cazarrecompensas en la Estación de Transferencia Ta, un enclave de los Especuladores en Bastión. Está más capacitado para ayudarte... y me debe un envío.\n\nReúnete con Ta\'oku y dile que te envía Ta\'nla.\n\nPara que te resulte más cómodo, te ofrezco un portal. Al fin y al cabo, somos socios, ¿no?', '', '', '', '', '', 'Habla con el cazarrecompensas Ta\'oku en la Estación de Transferencia Ta.', 39653),
(63980, 'esES', 'Buscando contrabandistas', 'Habla con Ta\'nla el Identificador, que está en el Mercado Nocturno.', 'Los Especuladores sabemos que debemos mantenernos siempre en movimiento. Y ser discretos.\n\nVarias de nuestras ciudades y avanzadas se hallan ocultas en la Zona Intermedia, aunque tienen la capacidad de desplazarse.\n\nPara mi disgusto, le he perdido la pista a Tazavesh.\n\nMe parece que nuestra mejor opción sería pedir acceso al Cártel Ta. Se jactan de saber siempre dónde está cada cosa.\n\nVamos a probar suerte con los Ta del Mercado Nocturno de Revendreth. Puede que sean más generosos que los de Oribos.', '', '', '', '', '', 'Habla con Ta\'nla el Identificador, que está en el Mercado Nocturno, en Revendreth.', 39653),
(63979, 'esES', 'Que no se sepa', 'Encuentra un manifiesto de carga del Cártel So.', 'La líder del Cártel So constituye un grave peligro para las Tierras Sombrías, Caminante de Las Fauces.\n\nSe llama So\'leah. Su objetivo es reconstruir un artefacto de los Primeros y usar su poder con sus propios fines.\n\nSe dice que las piezas de la reliquia están ocultas en tu mundo natal. Los Especuladores nunca hemos averiguado cómo llegar allí, pero, si So\'leah lo consigue, Azeroth también correrá peligro.\n\nDebemos pararle los pies.\n\nPor aquí cerca hay un cargamento a nombre del Cártel So. Puede que el manifiesto nos dé pistas sobre el paradero de su líder.', '', '', '', '', '', '', 39653),
(63977, 'esES', 'Comercio interior', 'Habla con los demás cárteles de los Especuladores en Oribos.', 'Soy el mayor experto en cultura de los Especuladores que existe. Sin embargo, las relaciones entre los cárteles son complicadas e inestables.\n\nEl Cártel So tiene una presencia mínima aquí, en Oribos, lo que significa que los demás podrían saber cosas que yo ignoro. Pregunta por ahí. Gracias a tu reputación, seguro que obtenemos la información que nos falta.', '', '', '', '', '', '', 39653),
(63976, 'esES', 'Al\'gato callejero de Oribos', 'Reúnete con el contacto misterioso en Oribos.', 'Ah, Caminante de Las Fauces. Tengo un mensaje.\n\nAlguien tiene una propuesta que hacerte. No conozco los detalles, solo que ha pedido que os reunáis en la parte de atrás de Idilia.', '', '', '', '', '', 'Reúnete con el contacto misterioso en Oribos.', 39653),
(63973, 'esES', 'Droman por partida doble', 'Ayuda a la droman Aliothe a derrotar a los enemigos que encuentre y a matar a lord Dretnal.', 'Tranquilízate, $p. Respira.\n\n<Tejesueños inhala y exhala lentamente>.\n\nLa situación está tensa por aquí, pero eso no quiere decir que tú también tengas que estarlo.\n\nTodo saldrá bien. Si no me crees, busca inspiración en las grandes proezas de la droman Aliothe y la droman Tashmur.\n\nSe fueron juntas a lo alto de la colina para despejarnos el camino. Se encargarán de todo enseguida.', '', '', '', '', '', 'Reúnete con lord Herne en el puente frente a la creciente oscuridad.', 39653),
(63971, 'esES', 'Pisando caracoles', 'Usa la varita de lady Bayalunar para transformar a 15 enemigos debilitados en caracoles y luego aplastarlos.', 'Ten cuidado con dónde pisas. No querrás aplastar sin querer a un jurafauces, ¿verdad?\n\n¡Pues claro que sí! ¡Es la mar de divertido!\n\n<Lady Bayalunar suelta una risita y señala los caracoles a su alrededor>.\n\nResulta mucho más sencillo aplastar jurafauces después de transformarlos en caracolillos apestosos.\n\nTen, toma mi varita y prueba con lo que quieras.\n\nPuede que antes tengas que debilitarlos un poco, ¡pero debería funcionar prácticamente con cualquiera!', '', '', '', '', '', 'Reúnete con lord Herne en el puente frente a la creciente oscuridad.', 39653),
(63970, 'esES', 'No dejaremos ni un alma atrás', 'Usa la cesta de rescate de Thiernax para rescatar a $3oa druidas perdidos en Gorgoa y enviárselos a Thiernax.', '¿Escuchas los gritos de las almas atormentadas atrapadas en Gorgoa?\n\nEl perverso Río de las Almas fluye ante nosotros, rebosante de crueldad y tormento contra víctimas inocentes.\n\nNuestro valiente regimiento de espíritus de druidas marchó hacia allí para rescatar a esas almas perdidas, pero me temo que muchos habrán acabado sumándose a su sufrimiento.\n\nÁrmate de coraje y llévate mi cesta al río. Carga en ella las almas perdidas que encuentres y mándame la cesta de vuelta.', '', '', '', '', '', 'Reúnete con Thiernax en el puente frente a la creciente oscuridad.', 39653),
(63969, 'esES', 'Oscuridad amenazante', 'Recoge $1oa libro ritual jurafauces, $2oa trozos de misiva jurafauces y $3oa de médula oscura.', 'La Reina del Invierno ha convocado una cacería en este lugar tras recibir informes sobre una oscuridad inmensa y antinatural que se extiende en las regiones superiores.\n\nLa Cacería Salvaje es valiente, pero no insensata. Debemos averiguar lo que podamos sobre esta oscuridad antes de cargar hacia ella.\n\nRegistra los cuerpos cercanos de nuestros enemigos para encontrar pistas.', '', '', '', '', '', 'Reúnete con lord Herne en el puente frente a la creciente oscuridad.', 39653),
(63964, 'esES', 'Botín de especulador: Garranefasta', 'Consigue un pico osificado maduro de Garranefasta.', 'Nuevas tierras implican nuevas oportunidades. Si os interesa, ofreceremos un buen número de objetos de valor a cambio del pico huesudo de la bestia conocida como Garranefasta, siempre que esté intacto.\n\nAbstenerse recolectores pusilánimes.\n\nLlevad la muestra a Ta\'nasi en el Respiro del Guardián.', '', '', 'Garranefasta', '', '', '', 39653),
(63963, 'esES', 'Botín de especulador: Rasgamaza', 'Consigue un pellejo con pinchos pesado de Rasgamaza.', 'Nuevas tierras implican nuevas oportunidades. Si os interesa, ofreceremos un buen número de objetos de valor a cambio de un trozo del pellejo punzante de la bestia conocida como Rasgamaza.\n\nAbstenerse recolectores pusilánimes.\n\nLlevad la muestra a Ta\'nasi en el Respiro del Guardián.', '', '', 'Rasgamaza', '', '', '', 39653),
(63962, 'esES', 'Los registros de observación', 'Recoge $1oa registros de observación del Mirador del Magullador de Korthia.', 'Saludos, Caminante de Las Fauces. ¿Tienes un momento?\n\nSeguro que sabes que mi cártel ha repartido discretamente una serie de dispositivos de observación por todo Korthia. No obstante, los datos no nos servirán de nada si no los recuperamos. Ahí es donde intervienes tú.\n\nLos registros del Mirador del Magullador ya deben de estar listos. No verás los dispositivos, pero los datos aparecerán como un orbe brillante.\n\nDevuélvemelos y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63961, 'esES', 'Secretos sellados', 'Recupera $1oa contenedores sellados del Mirador del Magullador de Korthia.', 'Ah, Korthia. ¿Qué secretos se descubrirán?\n\nMis socios han trabajado muy duro para descubrir y obtener pequeños objetos interesantes por toda esta tierra devastada. Nada de gran importancia, te lo aseguro.\n\nLos han guardado en unas arquetas que hay que recoger en el Mirador del Magullador. No te preocupes, están cerradas con un sello impenetrable que protege tanto los contenidos como al repartidor.\n\nTráeme los contenedores sellados y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63960, 'esES', 'Los registros de observación', 'Recoge $1oa registros de observación del Nidal Borrascoso y el Estuario del Despertar de Korthia.', 'Saludos, Caminante de Las Fauces. ¿Tienes un momento?\n\nSeguro que sabes que mi cártel ha repartido discretamente una serie de dispositivos de observación por todo Korthia. No obstante, los datos no nos servirán de nada si no los recuperamos. Ahí es donde intervienes tú.\n\nLos registros del Nidal Borrascoso y el Estuario del Despertar ya deben de estar listos. No verás los dispositivos, pero los datos aparecerán como un orbe brillante.\n\n¡No te olvides de mirar bajo tierra!\n\nDevuélvemelos y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63959, 'esES', 'Los registros de observación', 'Recoge $1oa registros de observación del Santuario de la Guía en Korthia.', 'Saludos, Caminante de Las Fauces. ¿Tienes un momento?\n\nSeguro que sabes que mi cártel ha repartido discretamente una serie de dispositivos de observación por todo Korthia. No obstante, los datos no nos servirán de nada si no los recuperamos. Ahí es donde intervienes tú.\n\nLos registros del Santuario de la Guía ya deben de estar listos. No verás los dispositivos, pero los datos aparecerán como un orbe brillante. No te olvides de mirar también en las cavernas bajo tierra.\n\nDevuélvemelos y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63958, 'esES', 'Los registros de observación', 'Recoge $1oa registros de observación en el exterior de la cámara de Korthia.', 'Saludos, Caminante de Las Fauces. ¿Tienes un momento?\n\nSeguro que sabes que mi cártel ha repartido discretamente una serie de dispositivos de observación por todo Korthia. No obstante, los datos no nos servirán de nada si no los recuperamos. Ahí es donde intervienes tú.\n\nLos registros del exterior de la cámara ya deben de estar listos. No verás los dispositivos, pero los datos aparecerán como un orbe brillante.\n\nDevuélvemelos y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
