(63955, 'esES', 'Secretos sellados', 'Recupera $1oa contenedores sellados de la cámara de Korthia.', 'Ah, Korthia. ¿Qué secretos se descubrirán?\n\nMis socios han trabajado muy duro para descubrir y obtener pequeños objetos interesantes por toda esta tierra devastada. Nada de gran importancia, te lo aseguro.\n\nLos han guardado en unas arquetas que hay que recoger en el exterior de la cámara. No te preocupes, están cerradas con un sello impenetrable que protege tanto los contenidos como al repartidor.\n\nTráeme los contenedores sellados y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63954, 'esES', 'Secretos sellados', 'Recupera $1oa contenedores sellados del Cuórum del Buscador.', 'Ah, Korthia. ¿Qué secretos se descubrirán?\n\nMis socios han trabajado muy duro para descubrir y obtener pequeños objetos interesantes por toda esta tierra devastada. Nada de gran importancia, te lo aseguro.\n\nLos han guardado en unas arquetas que hay que recoger en el Cuórum del Buscador. No te preocupes, están cerradas con un sello impenetrable que protege tanto los contenidos como al repartidor.\n\nTráeme los contenedores sellados y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63951, 'esES', 'Un lugar sombrío', 'Usa la piedra de falla desequilibrada para entrar en la falla y destruye trampas de velo de falla para liberar a $1a vorkai vinculafalla.', 'La existencia no es algo sencillo, $p. Está formada de capas sobre capas de realidades.\n\nLas trampas del Carcelero están atrayendo a nuestras tropas hacia una falla invisible.\n\nHe conseguido una piedra de falla desequilibrada. Te otorgará el poder de entrar en la falla para destruir las trampas que mantienen encerrados a los nuestros antes de que se pierdan para siempre.\n\nCuando hayas destruido las trampas de velo de falla, sal de allí y trae a los soldados a nuestra realidad.', '', '', '', '', '', 'Reúnete con la margravina Sin\'dane en el puente frente a la creciente oscuridad.', 39653),
(63950, 'esES', 'Garfas de alafilada', 'Consigue $1oa garfas de alafilada.', 'Mis cazadores no están familiarizados aún con estas tierras, pero hemos descubierto que aquí habitan unas bestias formidables.\n\nEntre ellas se encuentran los alafiladas, unos depredadores agresivos con unas garfas terribles... y con el genio de un vorkai.\n\n<Herne sonríe con ferocidad>.\n\nTráeme varias de sus garfas para que nuestros cazadores más novatos vean a qué tipo de bestias se enfrentarán.', '', '', '', '', '', '', 39653),
(63949, 'esES', 'Moldear el destino', 'Completa asaltos de las curias y misiones diarias, busca tesoros, mata criaturas poco comunes y derrota torturadores de Torghast para frustrar los planes del Carcelero en Korthia y en Las Fauces.', 'El poder y la maldad del Carcelero siguen aumentando. Nuestro temple también debe hacerlo.\n\nÁlzate entre tus aliados, $n. Lucha contra la oscuridad que pretende consumirnos a todos.\n\nJuntos, triunfaremos.\n\nQue el Propósito guíe tu mano.', '', '', '', '', '', '', 39653),
(63944, 'esES', 'Korthia aguarda', 'Informa a Tal-Galan, que está en el Respiro del Guardián, en Korthia.', 'Prepárate, $n. Nuestros aliados esperan tu llegada en Korthia.', '', '', '', '', '', '', 39653),
(63936, 'esES', 'El ánima devorada', 'Recupera $1oa de ánima devorada de los devoradores en el Estuario del Despertar.', '¡Sika tiene una idea!\n\nLos devoradores... devoran. ¡Se comen cualquier cosa! Así que también comen ánima.\n\nSi les arrebatamos el ánima a los devoradores, ¡será para nosotros!', '', '', '', '', '', '', 39653),
(63935, 'esES', 'Raíces valiosas', 'Reúne $1oa de ánima residual en los alrededores de la cámara de Korthia.', 'Korthia. Un bosque hermano, ahora desolado.\n\nPero en plena destrucción también se puede encontrar esperanza. \n\nReúne el ánima y reconstruye.', '', '', '', '', '', '', 39653),
(63934, 'esES', 'Ataque al correo', 'Recupera $1oa mensajes robados de la Guarida del Erudito.', '¡Hola, mortal!\n\nTengo que entregar unos mensajes a nuestros aliados en la fascinante Korthia. Sin embargo, no he podido cumplir mi cometido.\n\nLos jurafauces me robaron los mensajes que estaba programada para transportar y luego los almacenaron indebidamente por el suelo.\n\n¿Te importaría recogerlos y devolvérmelos? Yo me encargaré de entregárselos a sus destinatarios.\n\n¡Gracias!', '', '', '', '', '', '', 39653),
(63924, 'esES', 'El fetiche de zarpa de Gorak', 'Lleva el fetiche de zarpa de Gorak al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para este fetiche en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63923, 'esES', 'La talla de madera de la familia Lang', 'Lleva la talla de madera de la familia Lang al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para esta talla de madera en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63922, 'esES', 'Espada corta tajasombras', 'Lleva la espada corta tajasombras al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para esta espada corta en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63921, 'esES', 'El anillo de reflejo propio', 'Lleva el anillo de reflejo propio al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para este anillo en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63920, 'esES', 'El dispositivo de descifrado enigmático', 'Lleva el dispositivo de descifrado enigmático al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para este dispositivo en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63919, 'esES', 'Libro de Vínculo: El hechicero atormentado', 'Recoge $1oa páginas azures y llévaselas al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Escuchas una voz ahogada que habla en el interior del libro, intercalada con una estática crepitante. Apenas entiendes lo que dice, pero consigues discernir que te pide que recuperes unas páginas azures.\n\nAl hojear el volumen, te percatas de que faltan muchas páginas.\n\nSi se recuperasen, se podría devolver el libro al archivista para que lo reconstruyera>.', '', '', '', '', '', '', 39653),
(63918, 'esES', 'El obelisco de noticias aciagas', 'Lleva el obelisco de noticias aciagas al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para este obelisco en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63917, 'esES', 'La estatuilla siempreviva', 'Lleva la estatuilla siempreviva al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para esta estatuilla en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63916, 'esES', 'El saco de tierra extraña', 'Lleva el saco de tierra extraña al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para esta tierra en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63915, 'esES', 'El tambor del loa de la muerte', 'Lleva el tambor del loa de la muerte al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para este tambor en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63914, 'esES', 'La clave del entendimiento', 'Lleva la clave del entendimiento al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para esta clave en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63913, 'esES', 'El orbe explosivo inestable', 'Lleva el orbe explosivo inestable al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para este dispositivo en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63912, 'esES', 'El mapa celestial de las Tierras Sombrías', 'Recoge $1oa pergaminos de investigación de navegación del más allá y llévaselos al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Reconoces esta reliquia; la has visto en el Códice de los Archivistas.\n\nLos jurafauces la ignoraron pensando que no tenía utilidad.\n\nLo cierto es que no sirve para nada sin los datos cartográficos que se usan para trazar las ubicaciones relativas de cada más allá de las Tierras Sombrías. Si recuperas esta información de los eruditos fallecidos, podrías entregar el mapa completamente funcional al archivista>.', '', '', '', '', '', '', 39653),
(63911, 'esES', 'El lingote de acero cantante', 'Derrota a los invasores jurafauces y lleva el lingote de acero cantante al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<El lingote se lamenta con voz vibrante y gorjeante>.\n\n¡Qué tragedia! Estos rufianes me martillean sin miramientos y doblegan mi cuerpo para satisfacer sus viles propósitos.\n\n¡Qué vergüenza! Vergüenza debería darles.\n\n<El lingote emite un agudo grito de batalla>.\n\n¡Devuélveles el martilleo a esos jurafauces!', '', '', '', '', '', '', 39653),
(63910, 'esES', 'La estrella abisal', 'Recarga la estrella abisal y llévasela al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Reconoces la reliquia; la has visto en el Códice de los Archivistas.\n\nLa fuente de energía casi se ha agotado, pero se podrá reponer si se expone a ánima en estado puro y sin filtrar. Puedes usar las fisuras cercanas para ello>.', '', '', '', '', '', '', 39653),
(63909, 'esES', 'El disfraz del cambiante', 'Lleva el disfraz del cambiante al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para esta máscara en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63908, 'esES', 'El baluarte del propósito divino', 'Lleva el baluarte del propósito divino al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Tu conocimiento del Códice de los Archivistas deja patente que esta es una de las reliquias perdidas.\n\nEl archivista Roh-Suir tiene un lugar para este escudo en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63904, 'esES', 'El Corazón de Ardenweald', 'Investiga el Corazón del Bosque.', 'Guardé mi sigilo en el Corazón del Bosque para mantenerlo a salvo de las fuerzas de Las Fauces.\n\nPero han usado el cuerno para pedir ayuda.\n\nVete con tus aliados y averigua qué ha pasado.', '', '', '', '', '', 'Vuelve con la Reina del Invierno, que está a las afueras del Corazón del Bosque.', 39653),
(63903, 'esES', 'El asalto al Sagrario', 'Derrota a Sylvanas Brisaveloz en el Sagrario de Dominación.', 'El Carcelero se ha hecho con los sigilos de las cuatro curias. Está claro que pretende escapar de Las Fauces y robar el sigilo de la Enjuiciadora de Oribos.\n\nNo podemos permitirlo.\n\nEn lo alto de Torghast se encuentra el Sagrario de Dominación, sede de poder del Carcelero. Ha llegado la hora de entrar en ese siniestro lugar.\n\nSeguro que Sylvanas Brisaveloz liderará las fuerzas que tratarán de detenernos. Debemos derrotarla y liberar a Anduin Wrynn de su control.\n\nReúne a tus fuerzas, $n. Los caballeros de la Espada de Ébano lucharán a tu lado.', '', 'La Reina Alma en Pena es la clave de los planes del Carcelero. Encuéntrala... y párale los pies.', 'Sylvanas Brisaveloz', '', '', '', 39653),
(63902, 'esES', '¡Buenas noticias, amigos!', 'Vuela con Danica hasta Korthia para darle las noticias a Bolvar.', 'Ven, $gamigo mío:amiga mía;. Salgamos de este lugar infame.\n\nSeguro que tus compañeros estarán deseando conocer las noticias sobre la derrota de la Mirada. Te llevaré hasta ellos.\n\nAvísame cuando estés $glisto:lista; para partir, $n.', '', '', '', '', '', '', 39653),
(63901, 'esES', 'Enfocando la Mirada', 'Ve a la plataforma de la Terminal y usa el Ilskacuerno para invocar la ira de Odyn.', 'La combinación de pena y rabia que has acumulado será suficiente para tus necesidades. Al menos, eso creo.\n\nSi insistes en seguir adelante con esta empresa tan imprudente, usa el cuerno de la plataforma de la Terminal, donde el Río de las Almas fluye hacia Torghast. Allí son más potentes las energías.\n\nLa presencia de tus aliados dorados atraerá la atención de la Mirada del Carcelero. Espero que este no sea tu final. Detesto ver cómo se echan a perder las inversiones.', '', 'La Mirada del Carcelero registra Las Fauces en busca de enemigos del Carcelero.', 'La Mirada del Carcelero', '', '', '', 39653),
(63899, 'esES', 'El Libro de Vínculo: La bruja loca', 'Recoge $1oa páginas carmesíes y llévaselas al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Escuchas una voz ahogada que habla en el interior del libro, intercalada con una estática crepitante. Apenas entiendes lo que dice, pero consigues discernir que te pide que recuperes unas páginas carmesíes.\n\nAl hojear el volumen, te percatas de que faltan muchas páginas.\n\nSi se recuperasen, se podría devolver el libro al archivista para que lo reconstruyera>.', '', '', '', '', '', '', 39653),
(63896, 'esES', 'Las lágrimas de los condenados', 'Recoge $1oa lágrimas de los condenados de Gorgoa, el Río de las Almas.', 'Para anclar el instrumento a Las Fauces y que provoque el efecto que buscas, hay que imbuirlo de la agonía primaria en estado puro de las almas atrapadas en esta prisión maldita.\n\nLa pena aquí es abundante y, por tanto, fácil de obtener. Solo tienes que viajar a Gorgoa. Los condenados derraman abundantes lágrimas que caen en forma de pesar cristalizado mientras se los lleva el Río de las Almas.\n\nProcura que no te abrume su tristeza.', '', '', '', '', '', 'Lleva las lágrimas de los condenados a la proyección de Ve\'nari, que está en la orilla de Gorgoa.', 39653),
(63895, 'esES', 'Bolsa de sorpresas', 'Prueba el dispositivo de transporte de la bolsa de Ve\'nari.', 'Qué interesante: secuenciadores de aura y una capa etérea. Consérvalos bien, $n; sospecho que te serán útiles.\n\nAh, y hay algo que a mí también me resulta un tanto singular. Si no me equivoco, y rara vez lo hago, es un mecanismo de proyección. ¡Qué apropiado!\n\n¿Y qué es esto? Una especie de dispositivo de transporte. Deberíamos probarlo de inmediato.\n\nEs decir, deberías probarlo de inmediato.', '', '', '', '', '', '', 39653),
(63892, 'esES', 'Las piezas rúnicas de adivino', 'Recoge $1oa piezas rúnicas y llévaselas al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<Dentro de la faltriquera hay una sola pieza rúnica. Gira y se da la vuelta, como si la moviera una mano invisible.\n\nHay unas runas que recuerdan a la lengua vrykul talladas cuidadosamente en la piedra. La parte trasera de la pieza indica que forma parte de un conjunto>.', '', '', '', '', '', '', 39653),
(63867, 'esES', 'Controlar la ira', 'Usa el dispositivo succionador para drenar ira de las sombras furiosas del Río de las Almas.', 'No me dedico a la música, pero he pasado muchas horas disfrutando del entretenimiento en Tazavesh.\n\nPara darle voz a este cuerno, tendrás que hacer acopio de emociones fuertes.\n\nUna cólera desenfrenada embarga a los desafortunados condenados al Río de las Almas. Usa este dispositivo succionador para absorber la ira de esas sombras furiosas y almacenarla en tu instrumento.\n\nLos alaridos de furia que consigas te permitirán atravesar Las Fauces y llegar hasta tus aliados.\n\nLa melodía, me temo, no será muy popular.', '', '', '', '', '', 'Encuentra la proyección de Ve\'nari al borde del Río de las Almas.', 39653),
(63863, 'esES', 'Orgullo de unidad', 'Derrota a Malfestus, Domonus y Furis.', 'A pesar de nuestras diferencias, Nemea y yo trabajamos en equipo cuando nos enfrentamos a grandes amenazas. Tanto la manada como los falinces son luchadores feroces en el campo de batalla.\n\nPara nosotros sería un gran honor ayudarte en la batalla que nos aguarda.\n\nPermite que Andira o Gatamatos te ayuden a derrotar a los campeones del Carcelero que amenazan a nuestras fuerzas.', '', '', '', '', '', '', 39653),
(63861, 'esES', 'El comienzo de la colección', 'Recupera el códice de recuerdos para el archivista Roh-Suir en el Relicario de Recuerdos.', 'Continuemos nuestro trabajo y recuperemos el objeto más importante de toda investigación erudita: el códice perdido.\n\nLlevará tiempo, pero, si no cejamos en nuestro trabajo, las páginas de esta obra seguirán creciendo y prosperando como ha hecho Korthia durante eones.\n\nEn cuanto a su ubicación, antes residía en lo profundo de la propia Korthia, dentro de la Caverna de la Contemplación, al sur.\n\nEsperemos que las fuerzas del Carcelero no lo hayan localizado aún.', '', '', '', '', '', '', 39653),
(63860, 'esES', 'El dije del erudito eterno', 'Lleva el dije dañado al archivista Roh-Suir, que está en el Relicario de Recuerdos.', '<El talismán está mellado y tiene manchas de mugre. Quienquiera que lo haya ocultado aquí lo ha tratado con brusquedad.\n\nEl archivista Roh-Suir tiene un lugar para este talismán en el Relicario de Recuerdos>.', '', '', '', '', '', '', 39653),
(63859, 'esES', 'Salvados por las campanas', 'Defiende y toca las campanas de refuerzos del oeste, del este y del sur.', 'Nuestros administradores están preparando campanas de refuerzos para convocar a más kyrianos que nos ayuden en el asalto. No obstante, los jurafauces les están atacando para impedírselo.\n\nNecesitamos que defiendas a nuestros administradores mientras terminan el trabajo y que después toques cada una de las campanas para pedir refuerzos.', '', '', '', '', '', '', 39653),
(63857, 'esES', 'Voces de los Eternos', 'Escucha el plan.', '<Bolvar mira las grandes figuras que tiene delante, los innumerables portales que se extienden hacia el éter>.\n\nEsta cámara es... verdaderamente increíble.\n\nNo obstante, no hay tiempo para asombrarse. La honrada voz debe comenzar esta reunión de inmediato.', '', '', '', '', '', 'Vuelve al Enclave, que está en Oribos.', 39653),
(63856, 'esES', 'Una reunión de curias', 'Habla con Tal-Inara para entrar a la cámara de la Enjuiciadora.', 'Aunque el Carcelero siga confinado en Las Fauces, su crueldad se extiende más allá de los límites de su prisión.\n\nPor suerte, la Arconte se está recuperando del ataque. Aunque tengo entendido que su herida tiene una... naturaleza perturbadora.\n\nLos Eternos y sus aliados os esperan al alto señor Fordragón y a ti en la cámara de la Enjuiciadora. Yo iré delante.\n\nCon su voz he hablado.', '', '', '', '', '', '', 39653),
(63855, 'esES', 'Facilidad de paso', 'Establece una conexión entre Korthia y el Refugio de Ve\'nari.', 'Korthia ofrece un sinfín de oportunidades. Mira esos objetos tan intrigantes.\n\nSabía que encontraríamos verdaderas maravillas, así que he venido preparada. Vamos a buscar una ubicación adecuada para establecer una conexión más duradera entre este lugar y mi refugio.\n\nNuestra colaboración no ha terminado aún.', '', '', '', '', '', '', 39653),
(63853, 'esES', 'Extingue la llama', 'Mata a Infernus el Infinito para Theotar.', '¿Lo ves?\n\nSiempre está ahí, en mi campo de visión..., ¡y brilla muchísimo!\n\n¿Cómo me voy a relajar y a disfrutar de una taza de té con ese recordatorio de fuego y cenizas por aquí?\n\nCaminante de Las Fauces, hazme un favor. ¡Elimínalo para que todos podamos disfrutar de una taza de mi mezcla favorita!', '', 'Al igual que las forjas de la Caldera de Zovaal, sus llamas nunca se apagan.', 'Infernus el Infinito', '', '', '', 39653),
(63849, 'esES', 'Dispositivos de escucha', 'Coloca los secuenciadores de aura en Desmotaeron para ayudar a Ve\'nari a espiar a sus habitantes.', '¡Qué casualidad! Te han transferido a una ubicación que despierta en mí un cierto... interés. Coloca los secuenciadores de aura que te di e intentaré establecer una señal operativa.\n\nUn lugar tan peligroso requerirá de la mayor discreción. Usa la capa etérea para evitar que te vean.', '', '', '', '', '', '', 39653),
(63848, 'esES', 'Una muestra de gratitud', 'Habla con Ve\'nari, que está en el Respiro del Guardián, en Korthia.', 'Una profecía antigua predijo tu presencia aquí, Caminante de Las Fauces. Estoy convencido de que tus aliados y tú nos salvaréis.\n\nPuede que haya juzgado a tu amiga especuladora con demasiada dureza. A fin de cuentas, te trajo hasta Korthia.\n\nPor favor, dale las gracias a Ve\'nari y dile que responderemos a sus preguntas encantados.\n\nParece que tiene unas cuantas que hacernos.', '', '', '', '', '', '', 39653),
(63845, 'esES', 'La ira de Odyn', 'Sé testigo de la potenciación de las Val\'kyr elegidas y de la vinculación del Ilskacuerno.', 'Se ha forjado el cuerno y se ha seleccionado a las dignas.\n\nAhora, $n, solo nos queda vincular a mis Val\'kyr elegidas al cuerno e imbuirlas de mi poder para que puedan golpear con toda mi furia.\n\nAcompáñame y observa.', '', '', '', '', '', '', 39653),
(63844, 'esES', 'Los pocos elegidos', 'Ve al Círculo de la Gloria y lucha contra las Val\'kyr para determinar cuáles son las más dignas.', 'Necesito que más Val\'kyr se unan a Danica en la batalla que se avecina. $n, se te ha concedido el honor de elegir a las más dignas.\n\nLas más fuertes se enfrentarán al desafío en el Círculo de la Gloria. Lucha con todas tus fuerzas, $c, y honra tus armas.', '', '', '', '', '', '', 39653),
(63842, 'esES', 'Un buen truco', '¡Encoge a 15 enemigos y agranda $2oa ratas de Las Fauces para que se los coman en el Tremaculum!', 'Esos crueles torturadores me ponen furiosa...\n\n¡Los matones del Carcelero torturan a las almas buenas que envían aquí de forma injusta porque nadie se enfrenta a ellos!\n\nPues aquí estoy yo y tengo el plan perfecto para hacérselo pagar.\n\n¿Qué te parece? ¿Quieres ayudarme a cambiar las tornas con esos matones?', '', '', '', '', '', 'Reúnete con el príncipe Renathal. Está oculto bajo las escaleras en el Tremaculum.', 39653),
(63841, 'esES', 'La caza aérea', 'Usa la lanza de Korayn para abatir a $2oa rondadores de los cielos jurafauces y matarlos.', 'Botas el Hermoso y los demás dragadores grandes están sufriendo mucho por culpa de los asaltos aéreos.\n\nPuede que los dragadores no los alcancen, pero la Cacería Salvaje es capaz de abatir a cualquier presa.\n\nToma mi lanza y úsala para derribar a los jurafauces que sobrevuelan el puente occidental.\n\nUna vez en el suelo, será fácil despacharlos.\n\nMis tramperos te ayudarán a ralentizarlos.', '', '', '', '', '', 'Reúnete con el príncipe Renathal. Está oculto bajo las escaleras en el Tremaculum.', 39653),
(63839, 'esES', 'Aunque solo una sea digna', 'Examina almas indignas en el Tremaculum hasta que encuentres una que sea digna de verdad.', 'He visto con mis propios ojos cómo arrojaban almas dignas a Las Fauces de forma injusta.\n\nEl mismo Gresit estuvo a punto de ser arrojado por el esbirro del lord chambelán. Y había demostrado su valía más que de sobra mientras estaba a mi cargo.\n\nBusca entre las almas que la escoria del Carcelero ha considerado \"indignas\". Examínalas todas para confirmar que merecen estar aquí.\n\nSi, tras evaluar todas las almas del Tremaculum, encontramos una sola que sea digna de volver a Revendreth, habrá valido la pena.', '', '', '', '', '', 'Reúnete con el príncipe Renathal. Está oculto bajo las escaleras en el Tremaculum.', 39653),
(63838, 'esES', 'Desafío de duelista', 'Pídele a Botas el Hermoso que te lance a las murallas superiores y luego enfréntate a los campeones del ejército de los jurafauces.', '<Nadjia sigue parando ataques de los jurafauces enemigos mientras se vuelve hacia ti>.\n\nComo puedes comprobar, aquí en la barricada estamos hasta arriba de trabajo.\n\nYo defenderé la posición mientras tú te enfrentas a los campeones del ejército de los jurafauces.\n\nDerrótalos donde sus subordinados lo vean todo bien.\n\nSin piedad, $p. Hay que desmoralizarlos.', '', '', '', '', '', 'Reúnete con el príncipe Renathal. Está oculto bajo las escaleras en el Tremaculum.', 39653),
(63836, 'esES', 'El club de fans de Rajacolmillos', 'Mata a $1oa enemigos de Torghast que Rajacolmillos saque del portal.', 'Rajacolmillos es el dragador más fuerte que conozco. ¡Es increíble!\n\nAhí abajo está, en ese gran portal de Torghast, sacando a los malos de sus casas.\n\n¡Ni siquiera se pispan de lo que pasa la mitad del tiempo, ja, ja!\n\nCaragarrote y yo nos unimos a su club de fans en cuanto llegamos.\n\n¿Te apuntas? Tienes que ganártelo como el resto: ¡baja y pelea contra todo lo que saque del portal!', '', '', '', '', '', 'Reúnete con el príncipe Renathal. Está oculto bajo las escaleras en el Tremaculum.', 39653),
(63834, 'esES', 'Las armas del Tremaculum', 'Consigue $1oa armas de los jurafauces, $2oa coronas espantosas y $3oa ojos de sombra.', 'Los venthyr del Salto del Pecado no desperdician almas y sus natopiedra no desperdician armamento.\n\nHazte con las herramientas de nuestros enemigos para ponerlas al servicio de nuestras tropas.', '', '', '', '', '', 'Reúnete con el príncipe Renathal. Está oculto bajo las escaleras en el Tremaculum.', 39653),
(63833, 'esES', 'Terror en el Tremaculum', 'Mata a $1oa enemigos en el Tremaculum.', 'Estoy seguro de que mis compatriotas y generales tienen tareas más concretas que requieren tu ayuda.\n\nPero mi petición es sencilla. El enemigo nos rodea por todos los flancos.\n\nHazlo retroceder y danos más espacio para maniobrar.', '', '', '', '', '', 'Reúnete con el príncipe Renathal. Está oculto bajo las escaleras en el Tremaculum.', 39653),
(63831, 'esES', 'Que resuene la furia', 'Ayuda al maestro herrero Helgar en la Forja de Odyn.', '¡Pienso responder a este ataque contra mis Val\'kyr con una furia implacable!\n\nTú desempeñas un papel vital en esto, $c. Te armarás del valor que has demostrado hoy para atraer mi Ojo hasta la batalla.\n\nPero antes, te encomiendo una tarea más sencilla: la creación del cuerno que invocará mi cólera. El maestro herrero Helgar te guiará.', '', '', '', '', '', '', 39653),
(63829, 'esES', 'Aquí abajo nadie flota', '$1oa aspirantes atrapados rescatados.', 'Esta es nuestra oportunidad para liberar a los que creíamos perdidos.\n\nMuchos de nuestros aspirantes han acabado en manos del Carcelero como tropas de su ejército. Los que se resistieron dieron con sus huesos en las jaulas de arriba, abandonados hasta que se quebrase su alma.\n\nDestruye las cadenas de dominación y libera a los aspirantes atrapados de las jaulas.', '', '', '', '', '', '', 39653),
(63828, 'esES', 'El tamaño no importa', 'Usa el demoledor centurión para acabar con los ensamblajes del Carcelero.', 'El Carcelero ha desplegado un gran número de ensamblajes nuevos para hacer frente a nuestras fuerzas. Por suerte, estaba preparado para esta posibilidad. \n\nHe preparado a nuestro mayor centurión para que se haga cargo de esta amenaza.\n\nPor favor, Caminante de Las Fauces, súbete a él y dirígelo en combate.', '', '', '', '', '', '', 39653),
(63827, 'esES', 'Palabras de aliento', 'Recita las palabras del códice a $1oa protectores agotados.', 'Nuestras tropas llevan horas luchando sin descanso. Es normal que acaben agotadas y desmoralizadas.\n\nToma este códice y recítales las palabras que contiene. No te engañes: aunque parezcan insignificantes, encierran un enorme poder.\n\nRecita las palabras a los protectores agotados para insuflarles esperanza.', '', '', '', '', '', '', 39653),
(63824, 'esES', 'El asalto de los kyrianos', 'Completa $1oa misiones en el Bastión de la Perdición y en la Faz del Olvido.', 'Nuestro ataque ha sorprendido a las fuerzas del Carcelero. ¡Invadiremos el Bastión de la Perdición y derrotaremos a sus campeones en el Altar de Dominación!\n\nNecesitamos tu ayuda, Caminante de Las Fauces. ¡Apoya a nuestras fuerzas en el campo de batalla!', '', '', '', '', '', '', 39653),
(63823, 'esES', 'El asalto de las sílfides nocturnas', 'Completa $1oa misiones en el Bastión de la Perdición y en la Faz del Olvido.', 'Nuestro ataque ha sorprendido a las fuerzas del Carcelero. ¡Invadiremos el Bastión de la Perdición y derrotaremos a sus campeones en el Altar de Dominación!\n\nNecesitamos tu ayuda, Caminante de Las Fauces. ¡Apoya a nuestras fuerzas en el campo de batalla!', '', '', '', '', '', '', 39653),
(63822, 'esES', 'El asalto de los venthyr', '', '', '', '', '', '', '', '', 39653),
(63811, 'esES', 'Una relación de auténtico odio', 'Acompaña a Danica al Gran Salón del Hidromiel e informa a Odyn de lo que ha hecho Helya.', 'Cuando desapareció la primera de mis hermanas, nos preocupamos. Quienes fueron a buscarla nunca regresaron. Y lo mismo ocurrió con quienes fueron después.\n\nLo que hemos descubierto es una terrible traición de alguien en quien confiábamos.\n\nVen, tenemos que contarle a Odyn lo que hemos visto en Las Fauces.\n\nSu ira será terrible.', '', '', '', '', '', '', 39653),
(63810, 'esES', 'En compañía de pájaros', 'Sigue el rastro de plumas doradas para encontrar a quien las ha perdido.', 'He visto muchas alas de ébano en Las Fauces, pero nunca de un dorado brillante.\n\nAhora que los secuenciadores de aura ya transmiten correctamente, descubriremos el origen de las plumas.\n\nSigue el rastro, Caminante de Las Fauces. Seguro que este misterio nos reporta algún... beneficio.\n\nEn tu tierra de origen se valora mucho el oro, ¿verdad?', '', '', '', '', '', '', 39653),
(63794, 'esES', 'Botín de especulador: behemoth hambriento', 'Consigue una cantidad significativa de sangre de devorador de un behemoth hambriento.', 'Nuevas tierras implican nuevas oportunidades. Ofreceremos a los interesados un buen número de objetos de valor a cambio de una cantidad significativa de sangre de devorador, preferiblemente de tipo goliat.\n\nAbstenerse recolectores pusilánimes.\n\nLlevad la muestra a Ta\'nasi en el Respiro del Guardián.', '', '', 'El behemoth hambriento', '', '', '', 39653),
(63793, 'esES', 'Botín de especulador: Ensydius el Profanador', 'Derrota a Ensydius el Profanador.', 'Un jurafauces alado llamado Ensydius el Profanador está obstaculizando las operaciones del cártel en Korthia.\n\nQuien acabe con esa alimaña recibirá una recompensa. \n\nMucho cuidado. Ensydius es un enemigo poderoso. Puede que necesites aliados para derrotarlo.', '', '', 'Ensydius el Profanador', '', '', '', 39653),
(63792, 'esES', 'Botín de especulador: Nocturnus el Desentrañador', 'Derrota a Nocturnus el Desentrañador.', 'Un infame magus de Las Fauces llamado Nocturnus el Desentrañador está obstaculizando las operaciones del cártel en Korthia.\n\nQuien acabe con esa alimaña recibirá una recompensa. \n\nMucho cuidado. Nocturnus es un poderoso enemigo. Puede que necesites aliados para derrotarlo.', '', '', 'Nocturnus el Desentrañador', '', '', '', 39653),
(63791, 'esES', 'Botín de especulador: Valdinar el Maldinato', 'Derrota a Valdinar el Maldinato.', 'Un jurafauces con una armadura de pinchos llamado Valdinar el Maldinato está obstaculizando las operaciones del cártel en Korthia.\n\nQuien acabe con esa alimaña recibirá una recompensa. \n\nMucho cuidado. Valdinar es un enemigo poderoso. Puede que necesites aliados para derrotarlo.', '', '', 'Valdinar el Maldinato', '', '', '', 39653),
(63790, 'esES', 'Botín de especulador: lord Azzorak', 'Derrota a lord Azzorak.', 'Un poderoso Señor del Terror llamado lord Azzorak está obstaculizando las operaciones del cártel en Korthia.\n\nQuien acabe con esa alimaña recibirá una recompensa. \n\nMucho cuidado. Azzorak es un enemigo poderoso. Puede que necesites aliados para acabar con él.', '', '', 'Lord Azzorak', '', '', '', 39653),
(63789, 'esES', 'Esfuerzos continuos: Guarida del Erudito', 'Elimina a los jurafauces de la Guarida del Erudito.', 'No podemos permitir que los jurafauces se asienten tan cerca de nuestro campamento. Los auxiliares dicen que mantienen ese lugar oculto, pero yo no descansaré mientras pueda verlos.\n\nEntra en la Guarida del Erudito y acaba con las fuerzas del Carcelero que haya allí.', '', '', '', '', '', '', 39653),
(63788, 'esES', 'Esfuerzos continuos: Santuario de la Guía', 'Despeja el Santuario de la Guía de devoradores.', 'El Carcelero ha arrasado el hogar de los auxiliares, pero podemos prestarles ayuda en estos momentos difíciles.\n\nCerca de aquí se encuentra el Santuario de la Guía, del que hablan con reverencia y gran tristeza. Se trata de un lugar al que van a rezar y buscar la verdad, pero ahora mismo está infestado de devoradores.\n\nElimínalos para que puedan volver a encontrar consuelo en sus rituales y plegarias.', '', '', '', '', '', '', 39653),
(63787, 'esES', 'Esfuerzos continuos: Mirador del Magullador', 'Acaba con los pellejosquirlas del Mirador del Magullador.', 'Me dicen misss ojosss que el Mirador del Magullador está cerca del nuevo camino que va de Lasss Faucesss a Korthia. Dominarlo nosss brindaría una ventaja estratégica y táctica.\n\nPor desgracia, la zona está infestada de pellejosquirlasss.\n\nSi logramosss despejarla, podremosss avanzar sin impedimentosss hacia el oeste y, además, nos ssservirá como punto de observación para vigilar a lasss fuerzasss del Carcelero.', '', '', '', '', '', '', 39653),
(63786, 'esES', 'Despejar el Nidal Borrascoso', 'Viaja al Nidal Borrascoso y elimina a las criaturas hostiles de la zona.', 'Los cielos de Korthia son peligrosos.\n\nNo solo los jurafauces amenazan a nuestras tropas, la fauna de la zona también es abiertamente hostil. Debemos asegurar el cielo para nuestros aliados aéreos y sus bestias voladoras.\n\nLas criaturas voladoras de la zona provienen del Nidal Borrascoso. Ve hasta allí y elimina a las criaturas agresivas.\n\nAsí conseguiremos la supremacía aérea.', '', '', '', '', '', '', 39653),
(63785, 'esES', 'Esfuerzos continuos: Cuórum del Buscador', 'Expulsa a las fuerzas del Carcelero del Cuórum del Buscador en Korthia.', 'Los ataques de las fuerzas de Zovaal siguen devastando estas tierras.\n\nTenemos que enviarles un mensaje. Asegúrate de que sepan que no nos vamos a rendir, $n.\n\nEl poderío de Ardenweald está contigo.', '', '', '', '', '', '', 39653),
(63784, 'esES', 'El oro no es problema', 'Consigue $1oa grómits grises.', '¡$p! ¿Cómo te va?\n\nHemos oído que hay todo tipo de cosas interesantes por aquí.\n\nEsos saltarines furtivos son difíciles de ver, ¿a que sí? Tienen una pelambre resplandeciente que mis compañeros y yo podríamos usar para pasar desapercibidos, por decirlo así. Ya sabes, para evitar a los jefes y eso.\n\nNecesito que captures a unos cuantos. El oro no es problema. Tú tráeme a esas alimañas con vida.', '', '', '', '', '', '', 39653),
(63783, 'esES', 'Recuperación de ánima', 'Recupera $1oa muestras de ánima devorada de los devoradores del Santuario de la Guía.', 'Nuestros objetivos aquí requieren de un suministro constante de tropas, pertrechos y ánima. Esto último es lo más complicado de obtener por razones obvias, pero tengo mis recursos.\n\nCerca de aquí hay una fuente abundante de ánima: los devoradores que asedian el Santuario de la Guía. No es tan fácil como arrebatársela a golpes a un alma, pero es igual de efectivo si eres lo bastante fuerte. ¿Lo eres?', '', '', '', '', '', '', 39653),
(63782, 'esES', 'Rituales jurafauces', 'Consigue $1oa grimorios jurafauces.', 'Entre los jurafauces hay muchos que dominan la magia. No conocemos la que utilizan, y eso la vuelve letal.\n\nTenemos que averiguar de qué son capaces para preparar una defensa adecuada. Mi propia curiosidad sobre sus métodos y rituales es secundaria, claro.\n\nDa caza a esos viles taumaturgos y tráeme sus grimorios.', '', '', '', '', '', '', 39653),
(63781, 'esES', 'Los planes de batalla de los jurafauces', 'Recupera los planes de batalla de los jurafauces.', '¿Qué perjudica más al enemigo, que pierda un contingente de sus tropas o que obstaculicen sus comunicaciones?\n\nEs más, ¿y si esas comunicaciones te permitiesen a ti destacar a tus tropas estratégicamente para tender una emboscada a sus refuerzos?\n\nYa ves por dónde voy. Voxiferus, un teniente jurafauces, viajará de Las Fauces a Korthia por el camino del norte. Encuéntralo, mátalo y tráeme sus planes de batalla.', '', 'Este imponente general transporta los planes de batalla de los jurafauces entre Las Fauces y Korthia.', 'Teniente Voxiferus', '', '', '', 39653),
(63780, 'esES', '¡A ver qué tal les sienta!', 'Reúne $1oa emblemas jurafauces.', 'Me hierve la sangre solo de pensar en las fuerzas del Carcelero irrumpiendo en Ardenweald.\n\nY, cuando me enfadan, me vengo.\n\nO, mejor dicho, te pido ayuda a ti para vengarme. Asesina a esos jurafauces y tráeme sus emblemas para que sepa a cuántos has eliminado.\n\n¡Me da igual dónde los consigas, siempre y cuando sean de esa escoria de Las Fauces!', '', '', '', '', '', '', 39653),
(63779, 'esES', 'Una pizca de normalidad', 'Reúne $1oa ofrendas del santuario.', '$p, debemos ayudar a los auxiliares de Korthia. Han perdido mucho y de forma muy repentina.\n\nCerca de aquí está el Santuario de la Guía, de donde tomaban las ofrendas que dejaban luego en los santuarios. Desde la invasión de los jurafauces, no han podido entrar al Santuario ni recoger sus preciadas ofrendas.\n\nSi pudieras ir allí y recuperar las ofrendas. Ayudarías a los auxiliares a recuperar una cierta sensación de normalidad.', '', '', '', '', '', '', 39653),
(63778, 'esES', 'Avancemos', 'Reúne $1oa de ánima saqueada de la Guarida del Erudito en Korthia.', 'Me parte el alma ver otra tierra tan asolada. Imagino la belleza que Korthia tendría antaño.\n\nPero no debemos obsesionarnos con lo que hemos perdido. Como me enseñó Ara\'lon, no tenemos que quedarnos de brazos cruzados.\n\nPodemos optar por luchar.\n\nPuedes ayudarnos recuperando el ánima de los jurafauces. Nos servirá para fortalecer nuestras tropas y defensas.', '', '', '', '', '', '', 39653),
(63777, 'esES', 'Secretos sellados', 'Recupera $1oa contenedores sellados de la Guarida del Erudito.', 'Ah, Korthia. ¿Qué secretos se revelarán?\n\nMis socios han trabajado sin descanso para descubrir y obtener pequeños objetos interesantes por toda esta tierra devastada. Nada importante, te lo aseguro.\n\nLos han guardado en unos buzones que hay que recoger en la Guarida del Erudito. No te preocupes: están cerrados con un sello impenetrable que protege tanto los contenidos como al repartidor.\n\nTráeme los contenedores sellados y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63776, 'esES', 'Los registros de observación', 'Reúne $1oa registros de observación de la Guarida del Erudito.', 'Saludos, Caminante de Las Fauces. ¿Tienes un momento?\n\nSeguro que sabes que mi cártel ha repartido discretamente una serie de dispositivos de observación por toda Korthia. No obstante, los datos no nos servirán de nada si no los recuperamos. Ahí es donde intervienes tú.\n\nLos registros de la Guarida del Erudito ya deben de estar listos. No verás los dispositivos, pero los datos aparecerán como un orbe brillante.\n\nNo te olvides de mirar también en las cavernas bajo tierra.\n\nDevuélvemelos y te recompensaré con generosidad.', '', '', '', '', '', '', 39653),
(63775, 'esES', 'Criptogramas y llaves', 'Recupera $1oa criptógrafos robados en el exterior de la cámara y el Cuórum del Buscador.', 'Los depósitos de información de Korthia cuentan con varias capas de seguridad... por muy buenos motivos.\n\nPara descifrar y desactivar las barreras de cada cámara, se requieren varios criptógrafos. Son, a falta de una palabra mejor, la clave de los secretos de Korthia.\n\nBusca los criptógrafos que han robado los jurafauces en el exterior de la cámara y tráemelos. Los pondré a buen recaudo y los secretos que contienen estarán a salvo.', '', '', '', '', '', '', 39653),
(63774, 'esES', 'El ladrón de cadáveres', 'Entrega $1oa almas incorpóreas a los costureros del frente para que les confeccionen cuerpos nuevos.', 'Mira a nuestro alrededor, $p. Los cadáveres se amontonan por todas partes. Sus almas incorpóreas anhelan regresar a la batalla.\n\nAprovecharemos su fervor para cambiar las tornas.\n\n¡Reúne todas las almas incorpóreas del campo de batalla y llévaselas a mis costureros en los montones de cadáveres para que les confeccionen nuevos cuerpos!', '', '', '', '', '', 'Vuelve con la baronesa Draka.', 39653),
(63773, 'esES', 'Tú y qué ejército', 'Selecciona un campeón y elimina a $7oa arrasadores dominafauces y a $8oa demoledores dominafauces.', 'El Carcelero ha enviado un contingente de tropas de élite para atacar nuestra retaguardia. ¡Esto podría frustrar nuestro asalto!\n\nNecesito que acabes con esos enemigos junto con otro soldado. Se han presentado voluntarios de cada una de las cinco casas de Maldraxxus, $n.\n\nElige al que tendrá el honor de acompañarte.', '', '', '', '', '', 'Comunica tu éxito a la baronesa Draka.', 39653),
(63772, 'esES', 'Enemigo a las puertas laterales', 'Ayuda a Artemede y a las tropas kyrianas en la puerta sur del Bastión de la Perdición.', 'Han llegado tropas kyrianas para ayudar en el asalto. Han asegurado nuestro flanco y asediarán la puerta sur del Bastión de la Perdición.\n\n¡Informa a Artemede y ayuda a los kyrianos en lo que necesiten!', '', '', '', '', '', '', 39653),
(63764, 'esES', 'La conquista de los cielos', 'Vuela con Danica hasta las Cámaras de Odyn, en el Bastión Celestial.', 'He perdido a mis hermanas y lo que más deseo es vengarlas. Pero soy consciente de que no puedo enfrentarme a la magia de la bruja ni a su ejército de jurafauces.\n\nHemos de ser prudentes y huir.\n\nAunque el cautiverio me ha debilitado, todavía me quedan fuerzas para sacarte de este lugar.\n\nVámonos de aquí.', '', '', '', '', '', '', 39653),
(63763, 'esES', 'Podría ser cualquiera', 'Llévale la cabeza de Azodius a Bolvar Fordragón, que está en el Respiro del Guardián.', '<La cabeza aún caliente del Señor del Terror Azodius te mira con gesto agónico.\n\nHay que informar a los auxiliares del Respiro del Guardián sobre el secuestro del escriba del destino.\n\nEl alto señor Fordragón querrá estar al corriente de esta inesperada amenaza>.', '', '', '', '', '', 'Llévale la cabeza a Bolvar Fordragón, que está en el Respiro del Guardián.', 39653),
(63762, 'esES', 'Bajo la ilusión', 'Usa el instrumento del escriba del destino para disipar la ilusión.', 'El escriba del destino ha reunido los objetos necesarios para crear una ilusión en esta cámara. Por suerte, podemos usar su instrumento para disiparla y descubrirlo.\n\nSeguro que se alegra de ver una cara conocida.\n\nHe de reconocer que me has sido de gran ayuda. No lo habría conseguido sin ti.', '', '', '', '', '', '', 39653),
(63761, 'esES', 'Venganza retrasada', 'Mata a $1oa devoradores en el Santuario de la Guía.', '<El protector korthiano, gravemente herido, tiene dificultades para hablar>.\n\nLos devoradores... invadieron el santuario. Éramos muy pocos...\n\nMi deber... incompleto.\n\nEl Propósito... Yo...\n\n<Su voz se apaga>.', '', '', '', '', '', '', 39653),
(63760, 'esES', 'Ecos del destino', 'Haz que resuene el instrumento del escriba del destino en los lugares sagrados del Santuario de la Guía.', 'Los devoradores han invadido este lugar, pero nuestra prioridad sigue siendo encontrar al escriba del destino.\n\nLos auxiliares que rezaban aquí dejaban ofrendas de ánima en los santuarios.\n\nEl instrumento que encontraste resonará si el escriba del destino ha estado cerca. Con suerte, obtendremos más pistas sobre su posible paradero.', '', '', '', '', '', '', 39653),
(63759, 'esES', 'Redirigir la búsqueda', 'Reúnete con la custodia Kah-Than en la entrada del Santuario de la Guía de Korthia.', 'Creo que el escriba del destino iba hacia el Santuario de la Guía, un lugar sagrado para los auxiliares de Korthia.\n\nPor suerte, como tienes la costumbre de recoger toda la basura que te encuentras, tenemos el instrumento del escriba.\n\nSeguro que nos servirá para localizarlo. Pero antes, vamos al Santuario.', '', '', '', '', '', 'Reúnete con la custodia Kah-Than en la entrada del Santuario de la Guía de Korthia.', 39653),
(63758, 'esES', 'Donde menos te lo esperas', 'Busca al escriba del destino desaparecido en el Cuórum del Buscador.', 'Vine aquí con la esperanza de encontrar al escriba del destino o algún indicio que me ayudase a localizarlo.\n\nEs evidente que estuvo aquí y que sobrevivió a un ataque de los jurafauces. El único sitio donde no he buscado es una cámara de meditación que se encuentra al otro lado de las ruinas.\n\nNo puedo volver a adentrarme en el Cuórum del Buscador sola; es demasiado peligroso. ¿Podrías ayudarme?\n\nTengo que encontrar al escriba del destino. Es sumamente importante.', '', '', '', '', '', '', 39653),
(63757, 'esES', 'Saqueadores saqueados', 'Recupera $1oa artefactos korthianos de los jurafauces.', '<El jurafauces llevaba un artefacto korthiano.\n\nNo está claro qué pretenden hacer con esas reliquias, pero tienes la sensación de que los auxiliares del Respiro del Guardián querrán recuperarlas>.', '', '', '', '', '', '', 39653),
(63756, 'esES', 'Rescate del tormento', 'Rescata a $1oa auxiliares torturados en el Cuórum del Buscador.', 'Los jurafauces no se limitan a matar a quienes encuentran en el Cuórum del Buscador, sino que también interrogan a los supervivientes.\n\nTenemos que salvar a todos los que podamos. Incluso puede que alguno haya visto al escriba del destino.', '', '', '', '', '', '', 39653),
(63755, 'esES', 'Un asunto acuciante', 'Busca al escriba del destino de Korthia.', 'Caminante de Las Fauces, tenemos que resolver un asunto acuciante.\n\nNuestro escriba del destino ha desaparecido. No ha llegado. Habría pasado antes por el Cuórum del Buscador...\n\n<El escriba de caminos Roh-Vess hace una pausa>.\n\n¿Puedes buscarlo? Muchos auxiliares se ocultaron de los jurafauces en las cuevas cercanas a las ruinas.', '', '', '', '', '', '', 39653),
(63754, 'esES', 'El pájaro enjaulado', 'Consigue el sello forjainfiernos de Kjellrun y libera a Danica de su cautiverio.', 'No hagas ruido. No debemos llamar la atención.\n\nYa he perdido a muchas de mis hermanas. Pronto me llegará el turno de perecer en el malvado ritual de esa bruja.\n\nSácame de esta jaula y nos pondré a salvo. ¡Hay que informar al guardián Odyn de esta infame traición!\n\nLa jurafauces Kjellrun guarda el sello que puede liberarme. La encontrarás regodeándose en el salón que hay cerca.', '', '', 'Kjellrun la Lacerante', '', '', '', 39653),
(63753, 'esES', '¡Centuriones, en marcha!', 'Reúne $1oa motas de ánima para potenciar a los centuriones y ayudarlos en combate.', 'Tres de nuestros centuriones han irrumpido por la puerta lateral, pero necesitan más ánima para proseguir con su asalto.\n\nVarios de mis ayudantes han intentado llevarles ánima sin conseguirlo, así que te pido que recuperes el ánima y los ayudes en su ataque.', '', '', '', '', '', '', 39653),
(63740, 'esES', 'Consultar a los expertos', 'Entra en comunión con los monumentos de los archivistas.', 'Podemos restaurar las funciones del bastón de mina, pero necesitaremos la sabiduría de los archivistas.\n\nNo solo la mía, sino la de los archivistas que me precedieron. Descansan en paz cerca de aquí. Dado el nivel de destrucción de Korthia y la elevada posibilidad de que prosiga, esta podría ser nuestra última oportunidad de visitar sus monumentos antes de que sufran un daño irreparable.\n\nVisita los monumentos conmemorativos de los archivistas. Llévate a Roh-Suir contigo para que anote sus mensajes antes de que se pierdan.', '', '', '', '', '', '', 39653),
(63739, 'esES', 'Esperanza ascendente', 'Reúnete con la archivista Roh-Senara y con el erudito Roh-Suir cerca de la cumbre del Ascenso de la Esperanza.', 'Hay una última cosa que debemos hacer.\n\nNos veremos en lo alto del Ascenso de la Esperanza.', '', '', '', '', '', '', 39653),
(63738, 'esES', 'Los cimientos del archivo', 'Reúnete con el erudito Roh-Suir, que está en el Respiro del Guardián.', 'Me voy al Respiro del Guardián, que parece más o menos seguro.\n\nAllí crearemos un nuevo archivo.\n\nReúnete conmigo cuando puedas.\n\nEspero que podamos volver a contar contigo. Necesitaremos tu ayuda en el futuro.', '', '', '', '', '', '', 39653);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(63737, 'esES', 'Encontrar el auténtico propósito', 'Participa en el ritual para armonizar el bastón de mina.', 'Ha llegado la hora de la verdad.\n\nCon la sabiduría de los archivistas y un poco de ayuda de $gun:una; $c $r, armonizaremos el bastón de mina con las reliquias que buscamos.\n\nSi lo conseguimos, tendremos lo que necesitamos para restablecer el archivo.\n\nY podremos continuar nuestro trabajo sagrado.', '', '', '', '', '', '', 39653),
(63736, 'esES', 'Una infusión de ánima', 'Imbuye de ánima el bastón de mina.', 'En condiciones normales, usaríamos energía de la estrella abisal, otra reliquia importante, para imbuir el bastón de mina.\n\nPor desgracia, ahora no es posible. El ánima puede servir también en caso de necesidad.\n\nLlévate el bastón de mina. Acércalo a devoradores recién asesinados en el estuario de abajo.\n\nEl bastón atraerá y absorberá su ánima.', '', '', '', '', '', '', 39653),
(63734, 'esES', 'El bastón hendido', 'Recupera los tres segmentos del bastón de mina.', 'No me queda más remedio que confiarte los secretos del bastón de mina.\n\nEn las manos adecuadas, como las de un archivista entrenado, localiza reliquias trascendentales del más allá de las Tierras Sombrías.\n\nSe dividió en tres partes para que no cayese en manos inadecuadas. Los invasores han encontrado ya las piezas, pero aún no son conscientes de su relevancia.\n\nTienes que recuperarlas. Cada una de las partes está en manos de un jurafauces distinto.', '', '', '', '', '', '', 39653),
(63733, 'esES', 'Un camino para escapar', 'Derrota a $1oa invasores jurafauces.', 'Aborrezco la violencia y prefiero responder al conflicto con la palabra, pero aquí no tenemos alternativa.\n\nDebes asestar el golpe de gracia a los jurafauces que han invadido el Cuórum del Buscador para que Roh-Suir y yo podamos huir.\n\nAbre un camino para que podamos escapar.', '', '', '', '', '', '', 39653),
(63732, 'esES', 'Interrupción de los interrogatorios', 'Rescata a la archivista Roh-Senara.', 'Shhh... ¡Silencio!\n\nLos invasores me matarán si me encuentran aquí, como han hecho con tantos otros.\n\n<Roh-Suir señala desesperadamente hacia los jurafauces>.\n\n¡Están torturando a la archivista!\n\nTienes que encontrar el modo de rescatarla. ¡No podemos permitir que los jurafauces conozcan todo lo que sabe!', '', 'Este interrogador es tan despiadado como odioso.', 'El interrogador Tzench', '', '', '', 39653),
(63731, 'esES', 'Investigando reliquias korthianas', 'Busca al erudito Roh-Suir para averiguar más sobre las reliquias.', '<Encuentras un libro en mal estado que habla de las reliquias que se guardaban en Korthia.\n\nUn nombre escrito en sus páginas empieza a brillar: \"Roh-Suir\".\n\nEl libro da vueltas sobre tu mano y apunta en una dirección mientras el nombre Roh-Suir palpita.\n\nTal vez este tal Roh-Suir pueda ayudarte a descubrir más cosas sobre las reliquias que has encontrado>.', '', '', '', '', '', '', 39653),
(63728, 'esES', 'Búsqueda entre las casas', 'Habla con Ysera para averiguar más y luego busca a Huln Monte Alto en el Sepulcro del Saber.', 'He soñado que Tyrande Susurravientos es esencial para la supervivencia de Ardenweald.\n\nLas sílfides nocturnas han estado buscando otras Guerreras Nocturnas como ella y, para localizarlas, hemos reclutado a un antiguo aliado de Azeroth: Huln Monte Alto.\n\nEl poder de Elune es demasiado potente para que lo contenga un ser mortal, aunque ese mortal sea Tyrande. No sé cuánto tiempo más podrá aguantarlo.\n\nDeja que te explique los detalles y luego corre a Maldraxxus a reunirte con Huln.', '', '', '', '', '', '', 39653),
(63727, 'esES', 'El retorno del Prelado', 'Reúnete con el Prelado en el Respiro del Guardián para elaborar un nuevo plan de ataque.', 'El Carcelero tiene cuatro de los cinco sigilos que necesita para llevar a cabo sus planes.\n\nPero ha cometido una estupidez al dejarnos con vida. Su deseo de vernos sometidos a su voluntad será su ruina.\n\nSi estás $gdispuesto:dispuesta; a esforzarte al máximo, no todo está perdido. Aún queda algo que podemos hacer.\n\nVamos. Me reuniré con el resto de tus tropas y prepararemos nuestro próximo ataque.', '', '', '', '', '', 'Habla con el Prelado, que está en Korthia.', 39653),
(63726, 'esES', 'Desenmarañar el sigilo', 'Habla con Bolvar para decidir qué hacer con el sigilo.', 'El sigilo del Prelado está vinculado con magia de recuerdo. Se parece a algo que ya te encontraste antes.\n\nEl Grabador de Runas, esa pobre alma atrapada en las entrañas de Torghast, es ahora tu aliado. Él usó los recuerdos que encontraste para forjar armas y armaduras.\n\nTal vez él pueda desvincular el sigilo de esta maraña de recuerdos.\n\nEs nuestra mejor opción para proteger el sigilo. Pero el camino será peligroso.', '', '', '', '', '', 'Habla con el Prelado, que está en Torghast.', 39653),
(63725, 'esES', 'Al interior de la cámara', 'Recupera el sigilo del Prelado en el interior de la cámara de Korthia.', 'La destrucción de este lugar es... sobrecogedora.\n\n<Tal-Galan susurra una oración>.\n\nEl ánima fluye hacia lo que queda de la cámara. Ahora deberíamos poder entrar.\n\nUna vez dentro, trataré de recuperar el sigilo del Prelado.\n\nPor favor, muestra respeto en la cámara. Se trata de un lugar sagrado al que casi nadie tiene acceso.\n\nNi siquiera en las profecías se predecía que un mortal contemplase sus secretos.', '', '', '', '', '', 'Llévale el sigilo del Prelado a Bolvar Fordragón, que está en Korthia.', 39653),
(63722, 'esES', 'Custodios de Korthia', 'Rescata a 3 custodios de los archivos cerca de la Cámara de los Secretos.', 'Nos estaba costando mucho resistir contra las fuerzas del Carcelero. Ahora que estás aquí, por fin podremos avanzar.\n\nSé que tu prioridad es entrar en la cámara, pero también tenemos que rescatar a los custodios de los archivos.\n\nConocen todo lo que se guarda en la cámara y no podemos permitir que el Carcelero averigüe lo que saben.', '', '', '', '', '', 'Reúnete con el secutor Mevix en el interior de la Cámara de los Secretos.', 39653),
(63717, 'esES', 'La defensa de la cámara', 'Ayuda a la protectora Kah-Rev a derrotar a los jurafauces invasores.', 'Para llegar hasta la cámara, tenemos que abrirnos paso entre los jurafauces.\n\nLas curias están haciendo todo lo posible por repeler a esos monstruos, pero nuestros aliados no van a resistir eternamente. Los jurafauces están decididos a hacerse con el botín.\n\nNos vendría bien tu ayuda para luchar contra las fuerzas del Carcelero, Caminante de Las Fauces.\n\nQue el Propósito nos guíe a todos.', '', '', '', '', '', 'Reúnete con el secutor Mevix en el interior de la Cámara de los Secretos.', 39653),
(63714, 'esES', 'Hacia la cámara', 'Viaja en transportador alacortada a la Cámara de los Secretos.', 'Ahora que la herrera ósea ha reparado ambos conductos, el ánima debería estar fluyendo ya hacia la cámara. Eso nos permitirá entrar..., si es que conseguimos llegar hasta allí.\n\nNuestros aliados maldraxxi nos han conseguido un transporte para ir y venir de la cámara. Será mejor que nos demos prisa.\n\nSi los esbirros del Carcelero consiguen el sigilo del Prelado antes que nosotros, Korthia no será la única que sufra; todas las Tierras Sombrías estarán perdidas.\n\nVamos, Caminante de Las Fauces. Nuestras fuerzas nos esperan.', '', '', '', '', '', 'Habla con la protectora Kah-Rev en la Cámara de los Secretos.', 39653),
(63713, 'esES', 'Con mucho gancho', 'Llega hasta la isla flotante con un ganchomóvil y repara el conducto de ánima.', 'He creado unos cuantos ganchomóviles y puntos de agarre bien recios. No te preocupes: si pueden con mi peso, podrán con el tuyo.\n\nCon ellos podremos atravesar el abismo para llegar hasta el siguiente conducto de ánima.\n\nVoy a adelantarme y te espero allí. A saber lo que nos encontraremos al llegar.\n\nCuanto antes pongamos en marcha el conducto de ánima, antes entraremos a la cámara y recuperaremos el sigilo del Prelado.', '', '', '', '', '', '', 39653),
(63712, 'esES', 'Registros perdidos', 'Usa la baliza de la matriz para recuperar $2oa registros perdidos.', 'Algunos custodios de los archivos huyeron a esta montaña cuando el Carcelero arrastró Korthia hasta Las Fauces.\n\nNo queda ni rastro de ellos, pero puede que dejasen sus registros.\n\nToma esta baliza. La he creado con la información de los custodios que rescataste.\n\nTe conducirá a cualquier registro intacto que haya en esta montaña.', '', '', '', '', '', '', 39653),
(63711, 'esES', 'Herramientas de hueso', 'Recupera $1oa huesos imbuidos de ánima de la fauna.', '¿El dispositivo que tenemos que activar para abrir esta cámara está en una isla flotante?\n\nNo hay problema.\n\nHe visto un montón de criaturas bien grandes por los alrededores. Y como yo siempre digo: ¡los huesos no se desperdician!\n\nTráeme un montón de huesos. Los usaré para fabricar unos cuantos puntos de agarre para llegar con el ganchomóvil hasta allí.', '', '', '', '', '', '', 39653),
(63710, 'esES', 'El rastro de ánima', 'Sigue el rastro de ánima hasta el próximo conducto.', 'Así que lo que busca el Carcelero es el sigilo del Prelado. Tenemos que encontrarlo antes que los jurafauces. Para abrir la cámara, debemos potenciarla con ánima.\n\nAyudaste a la herrera ósea a reparar el primer conducto. El rastro de ánima que tenemos delante nos llevará hasta el siguiente.\n\nSi conseguimos activarlo, fluirá suficiente ánima hacia Korthia como para permitirnos entrar en la cámara.\n\nVamos, ¡démonos prisa!', '', '', '', '', '', 'Reúnete con Tal-Galan y la herrera ósea Heirmir al final del rastro de ánima.', 39653),
(63709, 'esES', 'Secretos de la cámara', 'Examina los registros recuperados con Tal-Galan.', '¡Qué suerte! Conseguiste rescatar a los custodios de los archivos antes de que los jurafauces descubrieran qué saben sobre las reliquias de la cámara.\n\nPero los registros están fragmentados. Incompletos. Espero que quede suficiente para averiguar la verdad.\n\nIntentaré agrupar toda la información en un solo mensaje. Si el Propósito así lo quiere, averiguaremos qué busca el Carcelero y a quién perteneció originalmente ese objeto.\n\nDebo concentrarme un momento. Avísame cuando quieras empezar.', '', '', '', '', '', '', 39653),
(63708, 'esES', 'Fantasmagoría', 'Llévale la fantasmagoría distorsionada a Ve\'nari, que está en el Refugio de Ve\'nari.', '<La extraña mota de energía de otro mundo brilla con un ritmo errático.\n\nPuede que a Ve\'nari le resulte interesante>.', '', '', '', '', '', '', 39653),
(63706, 'esES', 'Que fluya el ánima', 'Ayuda a la herrera ósea Heirmir a reparar el conducto de ánima.', 'Tal-Galan me ha informado de la situación y me ha explicado el funcionamiento de la cámara. Todo lo bien que podría hacerlo un erudito, vaya.\n\nPrimero, hay que asegurarse de que la cámara reciba energía. Usan conductos subterráneos para el suministro de ánima.\n\nEl auxiliar dice que uno de estos conductos está oculto en una cueva de la Guarida del Erudito.\n\nLlévame hasta allí y me encargaré de arreglarlo. Solo tienes que cubrirme las espaldas mientras averiguo cómo funcionan estos aparatos korthianos.', '', '', '', '', '', '', 39653),
(63705, 'esES', 'Los custodios del conocimiento', 'Rescata a $1oa custodios de los archivos de la Guarida del Erudito.', 'La cámara fue construida para albergar innumerables secretos y artefactos. Aunque consigamos entrar, no sabemos con exactitud qué busca el Carcelero.\n\nHay ciertos auxiliares, los custodios de los archivos, que se dedican a localizar objetos almacenados en la cámara y tienen fama de actuar con la mayor discreción.\n\nLos jurafauces han capturado a varios de ellos y los están torturando para obtener información.\n\nSalva a los custodios de los archivos, $n. Podrán ayudarnos a averiguar qué busca el Desterrado.', '', '', '', '', '', '', 39653),
(63704, 'esES', 'Venganza para Korthia', 'Mata a $1oa jurafauces en la Guarida del Erudito.', 'Nuestra prioridad es abrir la cámara, pero debo pedirte un favor.\n\nCuando Korthia fue arrastrada hasta Las Fauces, cundió el pánico entre mi pueblo. Huimos a la zona que ves delante de ti: un lugar de paz llamado la Guarida del Erudito.\n\nLos jurafauces nos atacaron al poco tiempo. Mataron a la mayoría y capturaron a los demás.\n\nSi pudiera vengarme yo mismo, lo haría. Pero..., al contrario que tú, no estoy preparado para la batalla.\n\nPor favor, demuestra a esos monstruos que su profanación de Korthia no quedará impune.', '', '', '', '', '', '', 39653),
(63703, 'esES', 'La Cámara de los Secretos', 'Reúnete con Tal-Galan a la entrada de la Guarida del Erudito.', 'Nos has ayudado a recuperar cierto orden, Caminante de Las Fauces, pero las previsiones no son nada buenas.\n\nLas fuerzas del Carcelero han lanzado un ataque total contra las ruinas de nuestra cámara en los confines de Korthia. Está claro que el Desterrado busca algo de valor en su interior.\n\nLas defensas de la cámara se activan cuando la estructura se ve amenazada, por lo que no va a ser fácil acceder al interior. Pero debemos encontrar lo que busca el Carcelero antes de que lo hagan sus jurafauces.\n\nMe he procurado la ayuda de una necroseñora que puede ayudarnos a abrir la cámara.', '', '', '', '', '', 'Habla con Tal-Galan a la entrada de la Guarida del Erudito.', 39653),
(63683, 'esES', 'El sigilo del invierno', 'Lleva la Lágrima de las Hermanas a Ysera, que está en el Corazón del Bosque.', 'Mi hermana... Después de todo este tiempo, no me ha abandonado...\n\n<Se atisba una pequeña sonrisa en la expresión de la Reina del Invierno, pero enseguida desaparece. Vuelve a clavarte una mirada cargada con el peso de milenios>.\n\nEscucha, $n. Toma la lágrima de mi hermana y ven al Corazón del Bosque.', '', '', '', '', '', '', 39653),
(63682, 'esES', 'El poder de Elune', 'Ayuda con el ritual.', 'Hemos hecho lo que hemos podido en el tiempo que teníamos.\n\nAhora debemos prestar nuestro poder a Thiernax y al resto con la esperanza de que Tyrande sobreviva.', '', '', '', '', '', '', 39653),
(63681, 'esES', 'De vuelta al Corazón', 'Vuelve con Ysera, que está delante del Corazón del Bosque, en Ardenweald.', '¡Debemos volver cuanto antes a Ardenweald!\n\nAdelántate y encuentra a Ysera. Yo escoltaré a la Pedregosa y me aseguraré de que Huln regresa.', '', '', '', '', '', 'Vuelve con Ysera, que está delante del Corazón del Bosque, en Ardenweald.', 39653),
(63680, 'esES', 'Justo al límite', 'Sigue el rastro de Huln Monte Alto.', '¡Parece que la mismísima Pedregosa se ha llevado a Huln a otro lugar!\n\nDeberíamos buscar su rastro por la zona. Con suerte, nos llevará hasta Huln.', '', '', '', '', '', '', 39653),
(63679, 'esES', '¡Un viaje misterioso y mágico!', 'Encuentra a lady Bayalunar en Revendreth.', '<La voz de lady Bayalunar surge del pergamino>.\n\n¡$n! Al parecer, Huln se ha metido en un lío y... Bueno, es complicado. ¡Nos vendría muy bien tu ayuda en Revendreth! Reúnete conmigo en la Fortaleza de la Dominancia.\n\n¡Nos vemos pronto!', '', '', '', '', '', 'Encuentra a lady Bayalunar en Revendreth.', 39653),
(63678, 'esES', 'Venganza por Akarek', 'Reúnete con la margravina Sin\'dane en Exoramas, en la Casa de los Rituales.', 'El último de los traidores involucrados en el asesinato del margrave Akarek está muerto.\n\nEsto no nos devolverá al margrave, pero aun así me satisface.\n\nMi baronesa quería que informásemos a la margravina Sin\'dane de que habíamos cumplido antes de viajar a Ardenweald.', '', '', '', '', '', 'Reúnete con la margravina Sin\'dane en Exoramas, en la Casa de los Rituales.', 39653),
(63677, 'esES', 'Solo te queda morir', 'Mata a Fal\'zinge en Exoramas.', 'El último nombre de mi lista es un exánime llamado Fal\'zinge.\n\nSin\'dane ha estado vigilándolo para averiguar los próximos planes de Kel\'Thuzad.\n\nQuiere que la ejecución de Fal\'zinge sea brutal.\n\nLo encontraremos en Exoramas, en la Casa de los Rituales.', '', 'Mata a Fal\'zinge.', 'Fal\'zinge', '', '', '', 39653),
(63676, 'esES', 'No puedes esconderte', 'Recupera las marcas de favor de Kel\'Thuzad y mata a Drava\'ora.', 'Algunos mantuvieron en secreto su lealtad a Kel\'Thuzad incluso después de que actuara. También ellos participaron en la caída de mi margrave y también morirán por ello.\n\nTengo un nombre: Drava\'ora, pero hay más. Sin\'dane dice que estos traidores llevan marcas de favor. No sabe quién las porta, así que tendremos que ponernos a matar hasta que las encontremos.\n\nServirá de escarmiento para los demás.', '', '', '', '', '', '', 39653),
(63675, 'esES', 'No puedes huir', 'Reúne pistas y mata a Zelmany.', 'Zelmany fue crucial en la caída de mi margrave.\n\nSin\'dane cree que está intentando reunir fuerzas leales a Kel\'Thuzad para que lo ayuden en su próxima conspiración.\n\nDeberíamos buscar pistas de su ubicación y acabar con él.', '', '', '', '', '', '', 39653),
(63674, 'esES', 'Con la venia', 'Reúnete con lady Vashj en el Trono del Prelado y pídele ayuda a Khaliiq.', 'Mi baronesa, lady Vashj, me ha encomendado una tarea. Con tu ayuda, mi venganza sería rápida. No obstante, debe dar el visto bueno a tu apoyo y darme a mí permiso para ayudarte con tu tarea.\n\nVe al Trono del Prelado. Allí hablaremos con ella.', '', '', '', '', '', '', 39653),
(63673, 'esES', 'Búsqueda entre las casas', 'Encuentra a Huln Monte Alto en Maldraxxus.', 'Tengo buenas noticias, $n. Ahora que las curias colaboran más estrechamente, la búsqueda de Huln avanza: ha encontrado pistas sólidas de la presencia de otras dos Guerreras Nocturnas aquí, en las Tierras Sombrías.\n\nQuiere que te reúnas con él en Maldraxxus para tratar este asunto. Te espera en el Sepulcro del Saber.\n\nDate prisa, $n. El poder de Elune está desgarrando la esencia de Tyrande. No sé cuánto más podrá aguantarlo.', '', '', '', '', '', '', 39653),
(63672, 'esES', 'Un grito desde el corazón', 'Reúnete con Ysera en el Corazón del Bosque.', '<La voz de Ysera emana del pergamino mientras lo lees>.\n\n$n:\n\nHay un asunto de gran importancia para el que necesito tu ayuda. Reúnete conmigo en el Corazón del Bosque cuanto antes.', '', '', '', '', '', '', 39653),
(63669, 'esES', 'Que alguien le eche de comer a Kevin', 'Consume $1oa enemigos derrotados para que Kevin crezca al máximo.', 'Mi familia de babas siempre está hambrienta de ánima. Por suerte, los cuerpos de los que caen derrotados aquí son una buena fuente de ella.\n\nCuanto más consumen, más crecen, y los restos de los caídos se convierten en parte de nuestra maravillosa familia feliz.\n\nLlévate a Kevin y deja que consuma enemigos caídos hasta que haya crecido del todo. Después, ¡úsalo contra nuestros adversarios!', '', '', '', '', '', 'Vuelve con la baronesa Draka.', 39653),
(63665, 'esES', 'Acceso a Oribos', 'Activa la piedra de puerta y viaja hasta Oribos.', 'Las profecías decían que un Caminante de Las Fauces necesitaría algún día esta piedra de puerta durmiente y que resultaría crucial para el destino de las Tierras Sombrías.\n\nParece que ese día ha llegado.\n\nRecurre a tu ánima interior para activar la piedra de puerta. Así podrán usarla todos los que te ayuden en tu misión.\n\nSi Tal-Inara ha creado un ancla en Oribos, como dices, podrás volver hasta nosotros gracias a ella.\n\nVe, $n. Informa a tus aliados de que Las Fauces aguardan... y de que Korthia necesita su ayuda.', '', '', '', '', '', 'Habla con Bolvar Fordragón, que está en el Círculo de Transferencias.', 39653),
(63664, 'esES', 'Al grano', 'Defiende la posición avanzada en el Bastión de la Perdición.', '¡Nuestra posición cerca del puente que conduce al Altar de Dominación está sufriendo un duro ataque! No podemos permitirnos el lujo de perder la balista que tenemos desplegada allí.\n\nCaminante de Las Fauces, ¡necesito que defiendas esa posición hasta que nuestras tropas puedan avanzar!', '', '', '', '', '', 'Vuelve con la baronesa Draka.', 39653),
(63663, 'esES', 'Korthia, la Ciudad de los Secretos', 'Espera a que Ve\'nari registre la zona y luego investiga lo que descubra.', 'Estamos a punto de cumplir nuestros deseos, Caminante de Las Fauces.\n\nTu anhelada piedra de puerta debe de estar cerca.\n\nMis necesidades, claro está, son mucho más modestas. Un poco de información útil por aquí, una reliquia de valor incalculable por allá...\n\nPeinaré la zona para ver si hay algo valioso o peligroso cerca. Luego podremos continuar.', '', '', '', '', '', 'Habla con Tal-Galan, que está cerca de la piedra de puerta inerte.', 39653),
(63662, 'esES', 'Misterios de Las Fauces', 'Viaja con Ve\'nari a la nueva masa de tierra en Las Fauces.', 'Las Fauces están cambiando, mortal, y los cambios brindan nuevas oportunidades.\n\nEl Carcelero ha traído a Las Fauces un reino que se ocultaba en lo más hondo de las Tierras Sombrías. Es un lugar que... me interesa especialmente, pero no quiero acercarme sola.\n\nLos jurafauces están invadiendo la zona, ¿sabes? Deben de estar buscando algo de valor.\n\nTengo un enclave seguro en las cercanías. Acompáñame hasta allí y tal vez pueda ayudarte a encontrar esa piedra de puerta que buscas.\n\n¿Hay trato?', '', '', '', '', '', 'Habla con Ve\'nari en la linde de la nueva zona.', 39653),
(63661, 'esES', 'Enlace a Las Fauces', 'Pregúntale a Ve\'nari por la ubicación de la segunda piedra de puerta.', 'El escriba del destino tiene la certeza de que ha aparecido una segunda piedra de puerta en Las Fauces. Debes ocuparte de encontrarla.\n\nYo crearé un ancla aquí, en Oribos, que se vinculará con tu ánima. Cuando te hayas armonizado con la piedra de puerta, el ancla estará conectada con ella.\n\nSi tienes éxito, las curias podrán enviar sus fuerzas al interior de Las Fauces y abandonarlas sin peligro.\n\nUsa los recursos de los que dispongas en Las Fauces para dar con la piedra de puerta.\n\nBuena suerte, mortal. Que el Propósito nos guíe a todos.', '', '', '', '', '', 'Habla con Ve\'nari, que está en el interior del Refugio de Ve\'nari.', 39653),
(63660, 'esES', 'Abrir Las Fauces', 'Deja que Tal-Inara examine tu alma.', 'El Carcelero ha conseguido otro sigilo y sus fuerzas asaltan Oribos sin descanso.\n\nBolvar Fordragón y Draka de Maldraxxus quieren responder a estos ataques.\n\nPero para hacerlo, necesitamos encontrar una vía de acceso a Las Fauces para las tropas.\n\nLa idea parecía imposible antes de que llegaras, pero ahora tengo esperanza.\n\nDebo examinar tu ánima para ver si es verdaderamente lo que desea el Propósito.', '', '', '', '', '', 'Habla con Tal-Inara, que está en el Círculo de Transferencias.', 39653),
(63659, 'esES', '¡Señores del Terror!', 'Habla con el Prelado, que está en Korthia.', 'Este esss el quinto Ssseñor del Terror que descubro infiltrado en nuestrasss filasss esta semana. Si no nosss encargamosss de ellosss, provocarán un daño tremendo en la posición que tenemosss aquí.\n\nEn vida aprendí a identificar a estasss criaturasss graciasss a un cazador de demoniosss. Por eso sssoy capaz de dar con ellosss, pero no puedo estar en todasss partesss a la vez.\n\nDebemosss informar al Prelado de todo esto.', '', '', '', '', '', 'Habla con el Prelado, que está en Korthia.', 39653),
(63656, 'esES', 'El sentido de la cólera', 'Informa al Prelado.', 'Reuniré a mis tropas y enviaré un destacamento a Korthia enseguida. También me encargaré de que les proporcionen las herramientas que crearon la baronesa Vashj y Kael\'thas para poder seguir defendiéndonos de las incursiones de los Nathrezim.\n\nHe de ocuparme de otros asuntos antes de bajar a Korthia. Debo proteger la Fortaleza de la Dominancia de nuevas infiltraciones.\n\nMe figuro que el Prelado querrá que se le informe. Puedes decirle que has tenido éxito.', '', '', '', '', '', 'Informa al Prelado.', 39653),
(63655, 'esES', 'El medallón de cólera', 'Lleva el medallón de cólera al estrado del Salto del Pecado.', 'Caminante de Las Fauces, marcharé con mis natopiedra hacia las profundidades de Las Fauces y les arrancaré la cabeza a todos los Nathrezim que me encuentre.\n\nNo obstante, Revendreth es un lugar demasiado estratégico en esta guerra como para perderlo por mera vanidad. \n\nPor eso, como segunda titular del cargo de cosechadora de cólera, te ofrezco mi medallón para que lo guardes y lo uses mientras lucho en esta guerra.\n\nÚsalo para aumentar el poder de los cosechadores a fin de que puedan evitar que Denathrius regrese y recupere el poder fácilmente.', '', '', '', '', '', 'Lleva el medallón de cólera al estrado del Salto del Pecado.', 39653),
(63654, 'esES', 'Los Nathrezim', 'Recupera el medallón de cólera de los Nathrezim.', 'El medallón de cólera es más que un artefacto poderoso. En manos de un Nathrezim, podría usarse para moldear este reino según sus tenebrosos designios. Es más: mientras lo tengan, no podremos forjar un nuevo sigilo.\n\nPor poco destruyen el Distrito de las Ascuas con sus temerarias maquinaciones. No permitiré que usen mi medallón para sus propios fines.\n\nVamos, debemos recuperarlo.', '', '', '', '', '', 'Habla con el príncipe Renathal, que está en el Torreón del Alba.', 39653),
(63653, 'esES', 'El poder de una corona', 'Sigue el rastro del medallón de cólera.', 'Estamos preparados.\n\nLa Corte de los Cosechadores usará el poder de los medallones que hemos conseguido hasta ahora para localizar el medallón de cólera. Si no lo han sacado del reino, deberíamos ser capaces de detectar su presencia.\n\nNo se trata de un ritual sencillo; los Nathrezim son maestros en evitar que los detecten. En cuanto veas el rastro, síguelo sin demora.\n\nY, cuando los encuentres, espera a que lleguemos antes de atacar.', '', '', '', '', '', 'Habla con la Pedregosa, que está en el Torreón del Alba.', 39653),
(63652, 'esES', 'Los invitados \"no deseados\"', 'Elimina a $1oa Nathrezim en el Salto del Pecado.', 'Chelra, es decir, Nal\'ragas, no trabajaba sola. Debemos ponernos en lo peor; asumir que no todos nuestros amigos y aliados son lo que parecen.\n\nLa Corte de los Cosechadores necesita tiempo para llevar a cabo el ritual de detección. Mientras tanto, estaremos expuestos. Debo pedirte que uses en el Salto del Pecado las técnicas a las que recurriste en la Puerta de la Dominancia para localizar a cualquier Nathrezim que se esconda entre nuestras filas.\n\nBuena caza.', '', '', '', '', '', '', 39653),
(63651, 'esES', 'Criptogramas', 'Transcribe $1oa criptogramas infernales.', 'Si los Nathrezim se han infiltrado en el Salto del Pecado, estarán comunicándose entre sí, y no solo mediante palabras y gestos. Les gusta escribir mensajes mágicos ocultos mediante sencillos sortilegios que los vuelven invisibles al resto.\n\nHe desarrollado un encantamiento que te permitirá ver esos mensajes.\n\nEncuentra los criptogramas y tráeme lo que contienen. Puedo traducirlos si superan tu capacidad de comprensión.', '', '', '', '', '', '', 39653),
(63650, 'esES', 'Desinfiltración', 'Reúnete con el príncipe Renathal en el Salto del Pecado.', 'Mal\'Ganis.\n\nHace siglos que no pronuncio ese nombre, pero ahora comprendo que debemos darle caza.\n\nSi tiene el medallón de cólera, no podrá esconderse. Utilizaremos los otros medallones que hemos recuperado para localizarlo.\n\nReúnete conmigo en el Salto del Pecado y trae a tu grupo de caza de Señores del Terror. Sospecho que los vamos a necesitar.', '', '', '', '', '', '', 39653),
(63649, 'esES', 'Espía contra espía', 'Localiza y derrota a $1oa Señores del Terror infiltrados.', 'Nathrezim. Ssseñores del Terror. Invitadosss ocultosss.\n\nEsss lo mismo, una raza creada para convertirse en los mejoresss espíasss de toda la realidad.\n\nPero en esta ocasión, han subestimado tresss elementosss crucialesss: ¡a Kael\'thasss Caminante del Sol, a la baronesa Vashj y a $n!\n\nTengo la herramienta que Kael\'thasss y yo usábamosss para detectar Nathrezim cuando estábamosss a lasss órdenesss de Illidan. ¡Y yo sssoy la matrona de espíasss!\n\nAsí que vamosss a cazar a estosss intrusosss.', '', '', '', '', '', '', 39653),
(63648, 'esES', 'Nal\'ragas', 'Localiza y derrota a Nal\'ragas.', 'El medallón de la Pedregosa no debe permanecer en manos de los Nathrezim. \n\nSegún lo que nos explicó la acusadora sobre nuestra misión, lo necesitamos si queremos forjar un nuevo sigilo para los venthyr. Seguro que la emboscada de Nal\'ragas y los suyos se debe a eso.\n\nLa magia de los medallones no pasa inadvertida y su efecto en este reino puede rastrearse con facilidad. Sugiero que demos caza y eliminemos a esa tal Nal\'ragas antes de que consiga refuerzos.', '', 'Una infiltrada experta de los Nathrezim.', 'Nal\'ragas', '', '', 'Habla con el príncipe Renathal.', 39653),
(63647, 'esES', 'Los invitados ocultos', 'Acompaña a la Pedregosa mientras investiga a la enviada diplomática.', 'Señores del Terror.\n\nClaro. Tenían que reaparecer precisamente ahora. Ya sospeché que podían haber regresado durante la sequía.\n\nLa primera vez que te vi, sopesé que pudieras ser $guno:una; de ellos. Se han vuelto más inteligentes desde que huyeron de Revendreth hace miles de años.\n\nPero no lo suficiente..., creo.\n\nVamos, Caminante de Las Fauces. Sígueme y no armes alboroto. Ten el arma a punto. La enviada que has traído no tiene tan buenas intenciones como aparenta.', '', '', '', '', '', '', 39653),
(63646, 'esES', 'El convoy de las curias', 'Reúne a los enviados diplomáticos y viaja a la Puerta de la Dominancia.', 'Para forjar un nuevo sigilo de los venthyr harían falta los siete medallones.\n\nEl Prelado estaba en lo cierto. Necesitamos a la Pedregosa. Sus desencuentros con los ocultos podrían llenar tomos enteros y tiene en su poder el último medallón que necesitamos. Ya va siendo hora de que la convenzamos para que se una a nuestra causa.\n\nMe encargaré de los preparativos. Esta vez lo haremos como es debido, con obsequios y diplomacia.\n\nInforma a Chelra; seguro que querrá organizar una escolta.', '', '', '', '', '', 'Entrega el mensaje del Prelado a la Pedregosa.', 39653),
(63645, 'esES', 'El prisionero del Torreón del Alba', 'Averigua el destino del sire Denathrius gracias al relato del príncipe Renathal.', 'Ah, aún no lo sabes.\n\nLo tenemos. El sire Denathrius, Maestro de Revendreth, está preso en su propia espada.\n\nConseguimos derrotarlo en uno de nuestros últimos asaltos al Castillo de Nathria.\n\nHizo falta un ejército valeroso y preparado como ningún otro. Destreza y recursos en abundancia. Un auténtico milagro.\n\nY de ese modo se redimirá el redentor. ¿Quieres saber más?', '', '', '', '', '', '', 39653),
(63644, 'esES', 'Malas noticias', 'Habla con el príncipe Renathal, que está en el Torreón del Alba, en Revendreth.', 'No debemos subestimar la amenaza que suponen los Nathrezim. Son astutos hasta el punto de rivalizar con los veteranos más avezados de la Casa de los Ojos, y además no conocemos sus intenciones.\n\nEntre los venthyr hay uno cuya ira ha asolado a los Nathrezim de las Tierras Sombrías durante muchos miles de años.\n\nQuiero que vayas al Salto del Pecado, te reúnas con el príncipe Renathal y le entregues esta misiva. Una de mis espías, la baronesa Vashj, te verá allí. Aprovecha su experiencia contra los Nathrezim.', '', '', '', '', '', 'Habla con el príncipe Renathal, que está en el Torreón del Alba.', 39653),
(63639, 'esES', 'De vuelta a Oribos', 'Vuelve con Tal-Inara, que está en Oribos.', 'Ardenweald ha resistido frente a la fuerza implacable de Las Fauces.\n\nPero no es suficiente.\n\nVuelve con nuestros aliados en Oribos. Debemos dar respuesta a esta pérdida y tomar medidas.', '', '', '', '', '', 'Vuelve con Tal-Inara, que está en Oribos.', 39653),
(63638, 'esES', 'No podemos darles la espalda', 'Comprueba la situación de la Reina del Invierno.', 'Nos hemos ocupado de Sylvanas y de sus jurafauces... Al menos, por el momento.\n\n¡Ahora debemos darnos prisa y asegurarnos de que la Reina y su sigilo están a salvo!\n\nLa Reina del Invierno estaba a las afueras del Corazón del Bosque, defendiendo las semillas silvestres robadas de las fuerzas de Las Fauces.', '', '', '', '', '', '', 39653),
(63625, 'esES', '¡Coge un hacha y a trabajar!', 'Elimina a $1oa soldados jurafauces y al comandante Mallamort.', '¡Nuestras tropas se están encontrado con una resistencia feroz! Caminante de Las Fauces, ¡hazte con un arma y enfréntate a ellos!\n\nAcaba con las tropas jurafauces que defienden estas puertas y con su comandante.', '', '', 'El comandante Mallamort', '', '', 'Comunica tu éxito a la baronesa Draka.', 39653),
(63624, 'esES', 'Las sendas que recorremos', 'Presencia la ceremonia de ascenso de Draka.', 'Los ejércitos de Maldraxxus son poderosos. Se recuperarán de la transgresión de Vyraz. \n\nLa reconstrucción debe ser lo primero. Caminante de Las Fauces, ¡sé testigo de la nueva era que se abre para Maldraxxus!', '', '', '', '', '', '', 39653),
(63623, 'esES', 'El trono vacante', 'Vuelve al Trono del Prelado.', 'Caminante de Las Fauces.\n\nDurante mi prolongada ausencia, has hecho mucho por devolver el orden y la fortaleza a la curia de los necroseñores. Como reconocimiento, te invito a presenciar una ceremonia.\n\nAcompáñame de vuelta a mi centro de poder en Maldraxxus. Ha llegado la hora de que premie a quien más fiel ha sido a nuestra causa.', '', '', '', '', '', 'Habla con el Prelado, que está en el Trono del Prelado.', 39653),
(63622, 'esES', 'Victoria en nuestro nombre', 'Vuelve con el Prelado, que está en Korthia.', 'Una vez despachados Helya y Vyraz, hoy hemos logrado una victoria importante contra los jurafauces. Es una demostración de lo que es capaz el poder combinado de las Tierras Sombrías.\n\nDeberíamos regresar a Korthia antes de que surja otra cosa.', '', '', '', '', '', '', 39653),
(63621, 'esES', 'Reacción en cadena', 'Elimina al guardián de las cadenas.', 'A este lo conocen como el guardián de las cadenas. No subestimes su poder. Ha vinculado las almas cercanas para preparar un ataque contra nuestra posición.\n\nNecesito que elimines esta amenaza, Caminante de Las Fauces, antes de que avance contra nuestras tropas.', '', 'Ha quebrado la voluntad de todas las almas con el vínculo de sus cadenas.', 'Guardián de las cadenas', '', '', '', 39653),
(63620, 'esES', 'El precio de la traición', 'Mata a Vyraz.', 'Desde su traición, Vyraz ha sido un incordio constante para Maldraxxus. Como baronesa de la Casa de los Elegidos, tengo el deber de eliminar esta amenaza... y vengar la muerte del margrave Krexus.\n\nTal y como dijo el Prelado, hay que cortar la cabeza de esta serpiente.\n\n¡Es el momento de actuar!', '', 'El tiempo se le agota al barón Vyraz, el traidor a Maldraxxus.', 'El barón Vyraz', '', '', '', 39653),
(63619, 'esES', 'Abjurantes y olvidados', 'Libera a $1oa prisioneros abjurantes.', 'Espera... ¡Yo te conozco! ¡Eres $gel:la; Caminante de Las Fauces!\n\nHan corrompido a mis hermanos y hermanas. Algunos aceptaron el poder de Helya, pero otros se resistieron. Ahora nos están obligando a todos a doblegarnos ante su poder.\n\nYo conseguí escapar cuando comenzó todo, pero están usando espantosos rituales con la mayoría de los abjurantes que quedan.\n\nPor favor, te suplico que los liberes. Luego regresaremos a Bastión para someternos al juicio de la Arconte.', '', '', '', '', '', '', 39653),
(63618, 'esES', 'La especialidad de Maldraxxus', 'Mata a $1oa jurafauces en Desmotaeron Superior.', 'Cada enemigo que eliminemos aquí es uno menos del que tendrá que encargarse nuestro ejército. Nos aseguraremos de que tardan en olvidar el auténtico propósito de Maldraxxus. Muéstrales lo que les ocurre a quienes amenazan las Tierras Sombrías.\n\nMata a todos los jurafauces que veas.', '', '', '', '', '', '', 39653),
(63617, 'esES', 'Barrotes doblados', 'Mata al guardaferro Salryx.', 'Con todo este caos, las puertas de la parte superior se han quedado abiertas. Si conseguimos colarnos, puede que no se percaten de nuestra presencia hasta que sea demasiado tarde.\n\nUno de los lugartenientes de Helya se interpone en nuestro camino hacia la Fortaleza de Helgarde. Acaba con él.', '', 'Este subyugador jurafauces lidera las fuerzas en Desmotaeron contra los ejércitos combinados del más allá.', 'El guardaferro Salryx', '', '', '', 39653),
(63616, 'esES', 'Un trabajo bien hecho', 'Da la señal a Zerekriss y comienza el asalto.', 'Estamos preparados para lanzar el asalto.\n\nDa la señal a Zerekriss. ¡Vamos a mostrarles el poderío de una necrópolis de Maldraxxus y de los ejércitos unidos de las Tierras Sombrías!', '', '', '', '', '', '', 39653),
(63615, 'esES', 'Cortarles las alas', 'Usa cadenas jurafauces para matar a $1oa rompealmas jurainfiernos.', 'El cielo está plagado de seguidores kyrianos de Helya. Si no reducimos su número, puede que Zerekriss y nuestros aliados aéreos tengan dificultades para avanzar.\n\nMe he fijado en que los jurafauces suelen usar cadenas mágicas. Podríamos usar sus armas contra ellos para derribarlos.', '', '', '', '', '', '', 39653),
(63614, 'esES', 'Arma en mano', 'Encuentra el hacha de Thrall, Dra\'gora.', '¿Tienes un momento, $n?\n\nLe arrojé mi hacha Dra\'gora a Helya durante nuestro primer encuentro en Las Fauces y no he vuelto a verla desde entonces. Si es cierto que dirige a sus fuerzas desde este sitio, puede que la tenga por aquí.\n\nFabriqué esa arma en Nagrand y me trae recuerdos de muchos buenos momentos que pasé con mi familia allí. Me gustaría volver a sentir su peso en mis manos.', '', '', '', '', '', '', 39653),
(63613, 'esES', 'Los portones de los condenados', 'Invoca $1oa portones de la muerte.', 'Debemos prepararnos para el asalto antes de avisar a Zerekriss. Cuando demos la señal, nuestros aliados usarán portones de la muerte para asaltar la zona.\n\nTenemos que encargarnos de invocar los portones de la muerte en este lado. Busca ubicaciones estratégicas adecuadas.', '', '', '', '', '', '', 39653),
(63612, 'esES', 'Cadenas de mando', 'Reúnete con Draka cerca de Desmotaeron.', 'Si queremos mantener una posición tan cerca de los territorios del Carcelero, debemos contar con ciertas garantías.\n\nVyraz y Helya se han replegado tras los muros de Desmotaeron. Y han descuidado su seguridad, lo que nos brinda una buena oportunidad.\n\nAtacaremos por sorpresa. Golpea rápido y sin piedad, y quizá consigamos cortarles la cabeza a esas serpientes.', '', '', '', '', '', 'Habla con Draka, que está cerca de Desmotaeron.', 39653),
(63593, 'esES', 'El nuevo sigilo de los kyrianos', 'Informa al Prelado, que está en Korthia.', 'Ahora que hemos asegurado un futuro de hermandad y devoción para Bastión, nace un nuevo sigilo que representará nuestro camino.\n\nInforma al Prelado de todo lo que has hecho. Cuando esté preparado, le entregaremos el sigilo.\n\nEsperemos que pueda usarlo para frustrar el plan del Carcelero y salvar las Tierras Sombrías.', '', '', '', '', '', 'Informa al Prelado, que está en Korthia.', 39653),
(63592, 'esES', 'El nuevo camino', 'Habla con Kalisthene para participar en la ceremonia en el trono de la Arconte.', 'Hoy nombramos un nuevo dechado. Y, por primera vez desde la fundación de este reino, cambia la consagración de un templo para representar nuestra devoción mutua.\n\nUn nuevo dechado, un nuevo sigilo y un nuevo camino para todos los kyrianos.\n\n¡Será una ceremonia gloriosa!', '', '', '', '', '', 'Habla con Adrestes, dechado de la devoción', 39653),
(63591, 'esES', 'La gran recepción', 'Habla con Kalisthene para ir a la reunión y después mézclate con tus nexos de almas y los otros kyrianos.', '$n, has ayudado a los kyrianos en tiempos tenebrosos. Tu devoción por nuestra causa ha contribuido a marcar un nuevo comienzo para todos nosotros.\n\nSería un honor que te unieras a la reunión previa a la ceremonia. Muchos miembros de nuestra curia desean expresarte su agradecimiento por todo lo que has hecho.\n\nHoy es un día de gran dicha. Me complace mucho que estés aquí para presenciarlo.', '', '', '', '', '', 'Habla con Kalisthene en la Fuente de la Lealtad.', 39653),
(63590, 'esES', 'El tañido de la campana de vísperas', 'Protege al polemarca Adrestes mientras da un nuevo propósito al Templo de la Lealtad.', 'La lealtad ya no será un principio exigido por el camino, sino una virtud que hay que ganarse. Una elección.\n\nDebemos mostrar nuestra devoción hacia todos aquellos que sufren, tanto si son almas recién llegadas como si son hermanos que necesitan ayuda.\n\nUsaré toda el ánima disponible para darle un nuevo propósito a este templo y dar paso así a una nueva era para los kyrianos.\n\nMe temo que los jurafauces intentarán frustrar nuestros planes. Protégeme durante el ritual, $n. Hay que completar esta tarea.', '', '', '', '', '', '', 39653),
(63589, 'esES', 'Dedicación redirigida', 'Redirige el ánima desde la Ciudadela de la Lealtad hasta el templo.', 'Los cinco templos de Bastión se han mantenido firmes desde su creación. Nunca se había contemplado la idea de cambiar el propósito de uno de ellos, y no cabe duda de que requerirá mucha ánima.\n\nBajo este templo hay unas reservas de ánima que racionábamos a causa de la sequía. Ahora que el ánima está regresando, podemos usarlas para nuestros fines.\n\nUsa los canalizadores y los recolectores de la zona para redirigir el ánima a la parte alta. Así conseguiré el poder que necesito.', '', '', '', '', '', '', 39653),
(63588, 'esES', 'La reconstrucción de la fe', 'Convence a $1oa abjurantes de que regresen al camino.', 'Los Abjurantes están perdidos, $n.\n\nSon como fantasmas que vagan por el Templo de la Lealtad. Sin otro sitio adonde ir. Sin líder, sin propósito, abandonados.\n\nDebemos demostrarles que hay un camino que pueden de seguir.\n\nPermíteme acompañarte al templo. Deja que hable con ellos y apele a sus sentimientos. Quizá podamos convencerlos de que le den una oportunidad al nuevo camino de Adrestes.', '', '', '', '', '', '', 39653),
(63587, 'esES', 'Ánima recuperable', 'Reúne $1oa núcleos de centurión corrupto de los centuriones abjurantes.', 'Mikanikos me ha explicado muchas cosas sobre los centuriones abjurantes, $n.\n\nAdmito que no lo he entendido todo, pero parece que aún no ha encontrado un modo fiable de hacer que recuperen sus patrones de funcionamiento correctos.\n\nNo obstante, ¡el ánima sigue siendo útil!\n\nAdrestes se ha centrado en darle un nuevo propósito al templo, pero ha descuidado su seguridad. Temo que el proceso le drene demasiada ánima.\n\nSi reúnes núcleos de centuriones abjurantes, podremos usarlos como reservas de ánima para Adrestes.', '', '', '', '', '', '', 39653),
(63586, 'esES', 'Compasión en la devoción', 'Reúnete con Adrestes en Reposo del Administrador.', 'Lo primero será darle un nuevo propósito al Templo de la Lealtad.\n\nPelagos se ha ofrecido a quedarse y colaborar en los preparativos de la ceremonia. Le he pedido a Nikolon que lleve a sus compañeros a Reposo del Administrador y que se reúnan con nosotros allí para que nos ayuden a convencer a algunos abjurantes de que debemos seguir este nuevo camino.\n\nVen a vernos allí en cuanto puedas.', '', '', '', '', '', 'Reúnete con Adrestes en Reposo del Administrador.', 39653),
(63585, 'esES', 'Lealtad ciega', 'Reúnete con el polemarca Adrestes en el Fuerte Elisio y acompáñalo a su audiencia con la Arconte.', 'Ahora veo claro el camino que deben seguir los kyrianos.\n\nPero antes hablaremos con Nikolon. Te ruego que te quedes a escuchar.\n\nDespués, regresaremos al Fuerte Elisio.\n\nSolicitaré una audiencia con la Arconte y necesito que todo el mundo me acompañe.', '', '', '', '', '', '', 39653),
(63584, 'esES', 'Un regreso triunfal', 'Reúnete con Kalisthene en el Fuerte Elisio.\n\nLa mensajera kyriana puede llevarte.', 'Este templo representa un nuevo amanecer para Bastión, $n.\n\nEl Templo de la Devoción se alzará como un símbolo de hermandad. Colaboraremos con los Abjurantes y con aspirantes y kyrianos de toda condición y origen para forjar un futuro del que sentirnos orgullosos.\n\nVolvamos al Fuerte Elisio. Quiero que nos acompañes en este momento tan trascendental: la ascensión de un nuevo dechado y la creación de un nuevo sigilo.', '', '', '', '', '', 'Reúnete con Kalisthene en el Fuerte Elisio.', 39653),
(63583, 'esES', 'Tengo intención de vivir eternamente', 'Ayuda a Uther a revivir su último recuerdo.', '$n, por favor. No he acabado.\n\nDebo ver un recuerdo más. Uno más que he de afrontar.\n\nNo... no será fácil. Me hará falta todo vuestro apoyo.\n\nPero es necesario.', '', '', '', '', '', '', 39653),
(63582, 'esES', 'Era mi discípulo', 'Ayuda a Uther a revivir su segundo recuerdo.', 'Los recuerdos de Uther sobre el príncipe Arthas lo atormentan profundamente. Por su culpa, el alma de Uther se fragmentó y Devos se extravió de esa manera.\n\nEl dolor de estos recuerdos es palpable.\n\nDebemos profundizar más. Uther debe enfrentarse a esta fuente de oscuridad.\n\nUna vez más, debes adentrarte en su pasado para proteger su futuro.', '', '', '', '', '', '', 39653),
(63581, 'esES', 'Entrar en la Luz', 'Usa el espejo de alma para ayudar a Uther a revivir su pasado.', 'Es lo que me temía.\n\nLa hoja de agonía que acabó con Uther ha oscurecido este fragmento de su alma. Sus recuerdos están distorsionados y destrozados.\n\nPara que Uther supere su dolor y su pena, debe revivir su pasado.\n\nPero no tiene por qué hacerlo solo.\n\nSi usamos mi espejo de alma, podremos ayudarlo a recorrer estos recuerdos. Así él podrá aceptar las emociones que contienen. Así podrá ver más allá de las distorsiones y comprender las verdades que albergan.', '', '', '', '', '', '', 39653),
(63580, 'esES', 'Recuerdos de dolor', 'Ayuda a Uther a establecer una conexión con el remanente de justicia.', 'La llegada del alma herida de Uther fue el detonante de muchos acontecimientos que hoy nos hacen sufrir.\n\nLa confianza rota de Devos, su colaboración con Helya, el ascenso de los Abjurantes...\n\nBastión necesita un cambio, pero no somos capaces de dar con la solución.\n\nQuizá este trozo de alma nos aporte información valiosa.', '', '', '', '', '', '', 39653),
(63579, 'esES', 'Alma de paladín', 'Recupera el remanente de justicia del Osario de los Desterrados, que está en Torghast.', 'Bolvar Fordragón ha tenido visiones sobre una cámara oculta en lo más profundo de Torghast donde el Carcelero guarda las almas que considera valiosas.\n\nUna hoja de agonía acabó con Uther. Cuando se empuña con ira un arma semejante, puede fragmentar el alma de la víctima.\n\nSi el Carcelero conserva una parte del alma de Uther, su alma no podrá recuperarse por completo sin el fragmento perdido.\n\nLleva este fragmento armonizado a Torghast, $p. Te conducirá hasta la ubicación de la cámara.\n\nEncuentra el trozo perdido del alma de Uther para que pueda volver a ser él mismo.', '', '', '', '', '', 'Reúnete con Thenios en el Templo de la Sabiduría, que está en Bastión.', 39653),
(63578, 'esES', 'La batalla de Ardenweald', 'Protege el sigilo de la Reina del Invierno en la batalla de Ardenweald.', 'Dada la traición del sire Denathrius y la ausencia del Prelado de Maldraxxus, no hay duda de que la Reina del Invierno será el próximo objetivo del Carcelero.\n\n¡No permitiremos que nadie se haga con su sigilo!\n\nArdenweald ha sufrido mucho, pero es un reino con un poder enorme y misterioso. Las cosas no son siempre lo que parecen.\n\n¡Eso nos dará una ventaja frente a quien vaya tras la Reina!', '', '', '', '', '', '', 39653),
(63576, 'esES', 'El primer paso', 'Habla con el polemarca Adrestes, que está en Oribos.', 'Mientras las curias se encargan de defender las Tierras Sombrías, el Carcelero no ha perdido el tiempo en Torghast. Por lo visto, pretende poner en marcha la fase siguiente de su plan.\n\nEl polemarca Adrestes nos ha traído noticias preocupantes del Fuerte Elisio. Te informará de lo que ha presenciado en cuanto llegues.\n\nDate prisa. Me temo que nos queda poco tiempo.', '', '', '', '', '', '', 39653),
(63543, 'esES', 'El asalto de los necroseñores', 'Completa $1oa misiones en el Bastión de la Perdición y en la Faz del Olvido.', 'Nuestro ataque ha sorprendido a las fuerzas del Carcelero. ¡Invadiremos el Bastión de la Perdición y derrotaremos a sus campeones en el Altar de Dominación!\n\nNecesitamos tu ayuda, Caminante de Las Fauces. ¡Apoya a nuestras fuerzas en el campo de batalla!', '', '', '', '', '', '', 39653),
(63435, 'esES', 'Tortazos en el templo', 'Derrota a Anthea en un duelo de mascotas.', 'Mis padres están ocupados defendiendo el Santuario de... los ocho... eh... cocos. No les estaba escuchando. Quizá por eso me dejaron aquí.\n\n¡Me dijeron que podía entrenar con el enorme gato blanco! ¡Voy a ser ninja!\n\n<Anthea lanza varias patadas hacia ti>.\n\n¡Ha! ¡Kia! ¡Ojito conmigo!\n\n...\n\nMe aburro. ¿Hacemos un duelo de mascotas? Tengo por aquí a todas mis mascotas preferidas.', '', '', '', '', '', '', 39653),
(63419, 'esES', 'Esporas por doquier', 'Consigue $1oa esporas.', 'Chuck vuelve a mencionar que la jungla parece viva y que algo no va bien.\n\nTe pide que recojas las esporas que llevan los fungáricos y las bestias que han infectado.\n\nChuck teme que lo que está ocurriendo no sea natural.', '', '', '', '', '', '', 39653),
(63418, 'esES', 'Explotadores explotados', 'Rescata a los amigos de Chuck.', 'Chuck explica que algo no va bien en la jungla y que unos fungáricos salvajes han capturado a su grupo.\n\nTe pide que rescates a sus amigos para averiguar qué está ocurriendo en la jungla.', '', '', '', '', '', '', 39653),
(62917, 'esES', 'Almas compartidas', 'Reúnete con la acusadora, que está en la forja de vínculos.', 'El poder de los cosechadores fluye por tu cuerpo mortal, pero podrías aumentar tu poderío si vinculases tu alma a otra.\n\nNo tiene inconvenientes y sí muchas ventajas para ambas partes.\n\nLa acusadora supervisará el proceso. Reúnete con ella en la forja de vínculos cuando estés $gpreparado:preparada;.', '', '', '', '', '', '', 39653),
(62852, 'esES', 'Dechado de la Cacería Salvaje', 'Habla con Aithlyn, que está en el Corazón del Bosque.', '¡Saludos, $n!\n\nHas demostrado tu valía a todo Ardenweald. Queremos concederte más recompensas, por el valor y astucia que has demostrado al servicio de nuestra causa.\n\nReúnete conmigo en el Corazón del Bosque.', '', '', '', '', '', '', 39653),
(62851, 'esES', 'Dechado del Ejército Inmortal', 'Habla con Nalcorn Talsen en el Teatro del Dolor.', 'Gracias a tus continuos avances en los objetivos del Ejército Inmortal, te has ganado el respeto de nuestras fuerzas.\n\nMe han autorizado a ofrecerte una parte del botín de guerra que hemos obtenido últimamente en señal de gratitud. Por favor, reúnete conmigo en el Trono del Prelado para recogerla lo antes posible.', '', '', '', '', '', '', 39653),
(62850, 'esES', 'Dechado de los Ascendidos', 'Habla con la ayudante Nikos, que está en el Reposo del Héroe, en Bastión.', 'Caminante de Las Fauces.\n\nTus esfuerzos han proporcionado a los Ascendidos una ventaja decisiva para lograr sus objetivos.\n\nTenemos recompensas para ti, y gracias.', '', '', '', '', '', '', 39653),
(62849, 'esES', 'Dechado de la Corte de los Cosechadores', 'Habla con la maestra Mihaela en Refugioscuro.', 'Caminante de Las Fauces.\n\nTus esfuerzos han proporcionado a la Corte de los Cosechadores una ventaja decisiva en su actual conflicto con los zelotes y aduladores que se aferran a la causa perdida del sire Denathrius.\n\nSi te reúnes conmigo en Refugioscuro, podremos expresarte nuestra gratitud de una manera... más... física.\n\nCon un tesoro, por supuesto.', '', '', '', '', '', '', 39653),
(62639, 'esES', 'El mejor', 'Derrota a 5 jugadores mediante Encontrar duelo con un equipo de mascotas de nivel 25.', 'Esta alineación de las estrellas es realmente extraña y provoca que las criaturas más pequeñas obtengan aptitudes antinaturales. Ninguno de nuestros sabios puede explicar el fenómeno, pero los domadores astutos tienen mucho que ganar, especialmente al probar sus habilidades contra sus iguales.', '', '', '', '', '', '', 39653),
(62225, 'esES', 'Explotar la burbuja', 'Sabotea $1oa experimentos del Culto de los Malditos en Mord\'rethar.', '<Las palabras del enigmático heraldo son oscuras y premonitorias. Sea lo que sea lo que \"el Desterrado\" quiere conseguir, no debemos permitirlo.\n\nAlgo nauseabundo se cuece en las calderas cercanas. A juzgar por el cuidado con que los cultores se ocupan de ellas, su contenido debe de ser crucial para sus planes.\n\nVarios barriles que contienen lo que parece ser un nuevo tipo de peste han quedado sin vigilancia. Tal vez nos sirvan como instrumentos de sabotaje>.', '', '', '', '', '', 'Regresa con la cruzada Renn, que está en la Fortificación del Muro de Hierro.', 39653),
(62143, 'esES', 'El asesinato del coronel Mort', '', '', '', '', '', '', '', '', 39653),
(62140, 'esES', 'El provocador venthyr', '', '', '', '', '', '', '', '', 39653),
(61615, 'esES', 'Sastrería: caperuza inquietante', '', '', '', '', '', '', '', '', 39653),
(61445, 'esES', 'Chismes de la corte (+Relajante)', '', '', '', '', '', '', '', '', 39653),
(60602, 'esES', 'Servicio secreto', '', '', '', '', '', '', '', '', 39653),
(60342, 'esES', 'Vamos a bajar humos', 'Mata a Charthox en el Bosque Dragado de Revendreth.', 'Estar ocioso es una pérdida de tiempo. Necesito tener las manos ocupadas, ¡o si no estas hojas no valdrán para nada!\n\nDicen que en Revendreth hay un devorador que es tan grande como una casa. ¡Enseñémosles a esos ensamblajes un par de cosillas eliminando a ese monstruo!', '', '', 'Charthox', '', '', '', 39653),
(60215, 'esES', 'El Caminante del Destino pisa fuerte', 'Derrota al Caminante del Destino en Tanaris.', '¿Has visto la monstruosidad mecánica gigantesca que deambula por las dunas? Viene de un lugar allende el tiempo, ¡y no es siquiera de Azeroth!\n\nLos portales del tiempo están chiflados en esta época del año.\n\n<Cromi saca un cronómetro pequeño que zumba con rapidez y lo toquetea. Parece haberse olvidado de ti por un instante>.\n\nAh, ¡sigues aquí! Genial. ¿Te importaría acabar con esa cosa? De lo contrario, ¡a la gente le costaría llegar a la fiesta!', '', '', '', '', '', '', 39653),
(59808, 'esES', 'Mugre a mansalva', '', '', '', '', '', '', '', '', 39653),
(59598, 'esES', 'Bueno para el alma', 'Habla con Merick.', '¡Dos almas son mejor que una! Juntos podemos lograr hazañas aún mayores que por separado.\n\nNo obstante, no estaremos solos ante el peligro. Habrá otros que nos presten su ayuda en las batallas venideras.\n\nHablemos con Merick para que nos cuente más. No seas $gtímido:tímida;, ¡yo os presentaré!', '', '', '', '', '', '', 39653),
(59259, 'esES', 'El torturador eterno', '', '', '', '', '', '', '', '', 39653),
(56470, 'esES', 'Duros de roer', 'Recoge $1oa trozos de carne de larva de médula de las larvas de médula gigantes.', 'Louison me ha dejado a Huesudo para que me ayude a encontrar larvas de médula, pero estoy hasta arriba aquí, en la cocina. ¿Me harías el favor de ir de caza en mi lugar?\n\nA Huesudo le encanta abalanzarse sobre los mordisqueadores pequeños y hace un ruido que no veas. Eso asustará a las larvas de médula más grandes y las hará huir. Actúa entonces.\n\nUsa este hueso para atraer a Huesudo cerca de los mordisqueadores. Ah, y no te olvides de recoger la carne de las larvas de médula, que es a lo que vamos.', '', '', '', '', '', '', 39653),
(47010, 'esES', 'Favor de la torre de magos', '', '', '', '', '', '', '', '', 39653),
(41561, 'esES', 'Pellejo vil', '', '', '', '', '', '', '', '', 39653),
(41550, 'esES', 'Trozo de beicon', '', '', '', '', '', '', '', '', 39653),
(41512, 'esES', 'Matojo vil', '', '', '', '', '', '', '', '', 39653),
(41210, 'esES', 'Destructor de azufre', '', '', '', '', '', '', '', '', 39653),
(3124, 'esES', 'Muisek de hipogrifo', 'Acaba con 10 hipogrifos Plumavieja de cualquier tipo y utiliza la vasija de muisek para encogerlos y capturarlos.', 'Has demostrado merecer mi confianza y tener facultad suficiente para utilizar a las vasijas de muisek. Ahora quisiera que capturases a otra criatura.$B$BLos hipogrifos han sido compañeros leales de los elfos de la noche durante muchos años; sus espíritus son leales e inquebrantables.$B$BTu tarea consiste en acabar con 10 hipogrifos Plumavieja y, rápidamente, encogerlos y capturarlos usando la vasija, de forma que podamos conservar su muisek. Podrás encontrarlos en las Altas Tierras Salvajes, al sur de aquí.', '', '', '', '', '', '', 39653);
